INSERT INTO `Event_event` VALUES (3,'Spell Bee','Test your skills of spelling and vocabulary! May the best speller win!',0,0,1,NULL,'','',NULL,9,4,1),(4,'Taboo','An APOGEE spin on the classic game: how many words can you communicate without using a Taboo word?',0,1,3,NULL,'','',NULL,9,4,1),(5,'Media Mania','Learn Live and Explore - The Media Way',0,0,NULL,NULL,'','',NULL,9,5,1),(6,'Daily Redesigned','Design a Daily\'s Cover!! ',0,0,NULL,NULL,'','',NULL,5,5,1),(7,'iReport','Report Dub and Win',0,0,NULL,NULL,'','',NULL,5,5,1),(8,'Music Quiz','NA',0,0,NULL,NULL,'','',NULL,8,6,1),(9,'Checkmate','Inside the richness of an interesting gameplan are blended finely some brain-juggling questions, that check your aptitude and puzzle solving skills in a way, altogether unique and unheard of. This Apogee, the ACM BITS Pilani proudly presents before you - Checkmate.',1,1,2,NULL,'','',NULL,9,7,1),(10,'ICL','ACM BITS Pilani presents ICL, International  Coding League, a computer programming competition based on the pattern of ACM-ICPC this Apogee 2016.',1,1,2,NULL,'','',0,5,7,1),(11,'Internet Whirlwind','NA',0,0,NULL,NULL,'','',0,9,7,1),(12,'Pictionary','\"Creativity is an elusive construct\"  .......   All those dumb-charades lovers, here is an event for you...come, unleash the \"creative coder\" inside you in this fun game , PICTIONARY Get your teammates to correctly guess the word by animating it through a piece of code.',0,1,NULL,NULL,'','',0,9,7,1),(13,'42','You have probably heard of imagination; you may have encountered logic too. But have you heard of Imaginative Logic or Logical Imagination? With this we\'ll have surely piqued your curiosity. Click on More for further details.',1,1,2,NULL,'','',0,8,8,1),(14,'Astronomy Workshop','Your first step to amateur astronomy, this guided workshop will teach you basics of astronomy and astrophysics, observational astronomy, how to use a Schmidt-Cassegrain telescope and a Galilean telescope, and the basics of astrophotography. There are no prerequisites.',0,1,3,NULL,'','',0,7,8,1),(15,'Sky Watching Session','Ever wished to star gaze in a quiet place far away from the city and its pollution? This is your chance. Come, discover the stars, planets, galaxies, nebulae, star clusters and much more!',0,0,NULL,NULL,'','',0,9,8,1),(16,'WIKI-Run','Find your way from one wiki to another, discovering the hidden connections.',0,1,NULL,NULL,'','',NULL,9,9,1),(17,'Unravel','Untangle the strings that weave nature together.Come, unravel the synergy in Science.',1,1,3,NULL,'','',0,9,13,1),(18,'Cicada 333031','Secret messages are all around us. Think you can discover the hidden truth? Put your beliefs to the test.',0,1,NULL,NULL,'','',NULL,9,9,1),(19,'Espoir','Espoir is the one of the first Business Plan competitions to be organized in the Health Sector in India. The bright elucidations put forth through this venture by ignited minds would surely help solve health problems of our nation and bestow upon us a joyous future.',1,1,4,NULL,'','',NULL,6,10,1),(20,'Doper\'s Quiz','Welcome to the myriad world of narcotics this APOGEE. Doper\'s Quiz is an online quizzing event based to test your logic relating to this field. ',1,0,NULL,NULL,'','',NULL,5,10,1),(21,'Dexter’s Laboratory','The event brings out the Dexter hidden deep inside you. Solve a puzzle show your laboratory skills and unleash the Dexter hidden in you. To pass the event,  grey matter is all you need.',1,1,2,NULL,'','',0,7,12,1),(22,'ChemWars','A war zone with a series of mind boggling and interactive rounds where not only knowledge but resource management is also a pre-requisite. Solve a puzzle, buy reagents of your choice  by biding and then, it will be an open battle for you all to defeat other teams and come out  with flying colours. So come in teams of 2 and get ready to be at war.',1,1,3,NULL,'','',0,9,12,1),(23,'Who Dunnit?','A murder mystery solving event. The final 6 teams, rigorously screened, have been put on the case to solve it. They will use resources available to them in the locality. The team that solves the case first will be rewarded.',1,1,3,NULL,'','',0,9,11,1),(24,'KRAZY BRIDGE','Build a bridge out of scrap.',1,1,4,NULL,'','',0,2,14,1),(25,'SRISHTI','A DRAWING-DESIGNING EVENT.',1,1,2,NULL,'','',0,2,14,1),(26,'Lift-it-Up','Science and a bit of imagination can do wonders. Lift-it-Up requires participants to make an efficient hydraulic jack with the help of materials that will be provided on the spot.',0,1,NULL,NULL,'','',0,2,15,1),(27,'C-Doku','A Knuckle thrilling sudoku competition for C language lovers. Complete the sudoku by solving simple C lang. snippets.',0,0,NULL,NULL,'','',0,3,16,1),(28,'Codestorm','An on-campus Coding Battle ',1,1,2,NULL,'imageuploads/CodeStorm.jpg','imageuploads/CodeStorm_oy6kmgh.jpg',0,3,17,1),(29,'Mindsweeper','Reason,logic,Rationale and spirit to complete',1,1,2,NULL,'imageuploads/Mindsweeper.jpg','imageuploads/Mindsweeper_wmWE0TO.jpg',0,5,17,1),(30,'Anticoding','Enjoy writing code unconventionally ',0,1,2,NULL,'imageuploads/Anticoding.jpg','imageuploads/Anticoding_0qyIuHP.jpg',0,3,17,1),(31,'Qrious','Online Quizzing event',0,0,1,NULL,'imageuploads/Qrious.jpg','imageuploads/Qrious_3RpRNaR.jpg',0,5,17,1),(32,'Bob the builder','See that little pile of junk? Remember the basic laws of science? Now just add a pinch of creativity and have fun making a contraption using all this!',0,1,4,NULL,'','',0,2,18,1),(33,'Galleria','All the artistic talent on campus being showcased under one roof. Do visit to have an experience full of life!',0,0,NULL,NULL,'','',0,9,18,1),(34,'Bitsopoly','A monopoly game with a lot of twists and turns!!!',0,1,2,NULL,'','',0,6,19,1),(35,'Business Master','APOGEE 2016 presents BUSINESS MASTER, for the ones who love participating in Case Competitions. The event seeks to stimulate immense brainstorming and intensive business-minded thinking.',0,0,NULL,NULL,'','',0,6,19,1),(36,'Stock Market Simulation','The stock market runs on three things: optimism, scepticism, and criticism. Have you got them all? We bring you a virtual platform for real time trade experience. An event that tests your calibre to earn out of your earnings, to make money out of money.',1,1,2,NULL,'','',0,6,19,1),(37,'Track-o-mania','Maze solving line follower - A game where your problem solving skill is tested along with your ability to build a line following bot.',1,1,4,NULL,'imageuploads/Track-o-Mania.png','imageuploads/40365_Line_Follower_Robot.jpg',0,4,20,1),(38,'I-strike','Does the words robots,automaton and image processing excite you? Then APOGEE 2016 have just the right event for you, iStrike ; build a robot capable of moving on a maze, avoiding obstacles to its destination.',1,1,4,NULL,'','',1,4,20,1),(39,'Robots at war','Heard about the 3 LAWS of Robotics given by Issac Asimov? Apogee 2016 redefines the third-A robot must protect its own existence; to hell with everything else.',1,1,4,NULL,'','',1,4,20,1),(40,'AIC','Organized in collaboration with various multinational companies, this event presents before  you existing challenges faced by these companies who seek their solutions from you. Exciting Internship opportunities and cash prizes worth Rs. 72k await the winners.',0,1,4,NULL,'','',1,9,21,1),(41,'APOGEE - Just A Minute (A JAM)','If you fancy your oratory skills and are the perennial Grammar Nazi of your friend circle, look no further. Participate in the first ever APOGEE JAM and make history.',0,0,1,NULL,'','',0,9,22,1),(42,'Brain of BITS','Only the best of BITS shall emerge victorious in this highlight quiz of APOGEE. Compete with stalwarts to claim the most coveted title in BITSian quizzing circles.',0,0,1,NULL,'','',0,8,22,1),(43,'Overhead Transmission (OHT)','Think you know it all? Test how you would fare against the best in this open-to-all quiz, about anything under the sun.',0,1,3,NULL,'','',0,8,22,1),(44,'Science and Technology Quiz','Whether you\'re proud of your scientific achievements or you know everything there is to know about the latest smartphone, this quiz is for you.',0,1,3,NULL,'','',0,8,22,1),(45,'Speed Scrabble','In this battle of words against the clock, quick thinking (and a bit of luck) will make you the champion. Revel in the madness of Scrabble, now with extra adrenaline!',0,0,1,NULL,'','',0,9,22,1),(46,'Relay dumb charades','A fun filled extravaganza of dumb charades!',0,1,3,NULL,'imageuploads/dumb-charades.jpg','',0,9,23,1),(47,'App Relay','Online event in teams if three. A problem statement will be given on the first day and portal will be open for 3 days.On the last day after presentation and evaluation final winners will be declared.',1,1,3,NULL,'','',0,5,24,1),(48,'Music Gallery','NA',0,0,NULL,NULL,'','',0,9,25,1),(49,'Ahvaan',' “Be the change that you wish to see in the world.” - Mahatma Gandhi Are you dissatisfied with the state of the world? Do you think you have it in you to be the catalyst for change? If yes, HAS presents an event just for you!  Ahvaan is a 2 day event which challenges the intellect with real world issues and forces competitors to duke it out with their solutions. The person with the best ideas wins',0,0,1,NULL,'','',NULL,9,26,1),(50,'Word-A-Maze','Do you feel that you know everything about your mother tongue? Think speaking in Hindi is child\'s play? For those who do, Hindi Activities Society presents Word-A-Maze, an event that challenges your Hindi vocabulary in a creative and innovative manner.',0,1,2,NULL,'','',NULL,8,26,1),(51,'Network Design Challenge','Design your own local area network from scratch. Sounds intimidating? Well, a workshop will be held soon!',1,1,2,NULL,'imageuploads/ndc.jpg','imageuploads/ndc_Q0uwW7p.jpg',0,3,27,1),(52,'plAI','Develop an AI Bot for the provided video game interface. Sounds intimidating? A sample bot is up and ready to make things simpler!',1,1,2,NULL,'','',0,3,27,1),(53,'Jeopardy','An unconventional game show that combines the popular TV show \"Jeopardy!\" with the simplicity of a trivia quiz. Answer questions and ask your answers!',0,1,1,NULL,'','',0,8,28,1),(54,'Treasure Hunt','Codes, ciphers and cryptexes...these shall lead you on your quest. The treasure lies waiting...or does it?',0,1,1,NULL,'','',0,9,28,1),(55,'New Event','Bring all your skills and talents along because you\'re gonna need \'em. A game that will have you racking your brain and running around.',0,1,1,NULL,'','',0,9,28,1),(56,'Lacuna','Put your thinking and gaming skills to the test. Navigate across different levels to find and solve hidden clues. Puzzles! Riddles! Ciphers!',1,0,1,NULL,'','',0,5,28,1),(57,'Srikanth Visweswariah Analog Design Challenge','Do you have the spirit of designing circuits? Do you love analog electronics over digital electronics?  APOGEE 2016 presents Analog Design Challenge. Design circuits using analog concepts in the OLab.',0,1,2,NULL,'','',0,3,29,1),(58,'Circuit Design Challenge','Are you one of those people who like to play with one and zero? Do you have the spirit of designing circuits with one and zero?  This Apogee, we give you that opportunity to design the circuits in an innovative manner.',0,1,2,NULL,'','',0,4,29,1),(59,'Innover','Innover is a product design and development event that centres around the re-invention and marketing strategy to replace already existing product. This year\'s theme is \"Smart-Cycle\".',1,1,4,NULL,'imageuploads/Innover_final_logo.jpg','',0,2,30,1),(60,'Reverse Engineering','Ever wondered how different mechanisms works. Reverse Engineering brings you the opportunity to get your hands on the most complex units.',1,1,5,NULL,'imageuploads/Reverse_E_Logo.png','',1,7,30,1),(61,'Gambling mathematics','Are you eager to gamble in the crowd ? Here comes the chance!! Come with your team (max. 2) and invoke the real gambler inside you!',1,1,2,NULL,'','',0,9,31,1),(62,'Zombie Mathematics','Survive in Mathematical zombie battle-An event where you can completely eat up opponent\'s mind by answering tricky questions. Be a ZOMBIE and carry away MATHE-ZOMBIAL experiences!',1,1,2,NULL,'','',0,9,31,1),(63,'Join and win!','Attend and make your attendance count!Join this event online, answer the questions based on the events that have happened on the same day and win EXCITING prizes!!',1,0,1,NULL,'','',0,5,31,1),(64,'Anime-Comics-Manga event','All of us have experienced the magic of a comic book/manga/anime at least once in our life. The extraordinary stories, the amazing pictures, how can one not like them! This Apogee, we have just the perfect thing for the fan in you. ',0,0,NULL,NULL,'','',0,9,32,1),(65,'Movie/TV Series Goof Ups','Discover the imperfect world of our movies and Tv shows...and enjoy the obvious and not so obvious goof-ups',0,1,3,NULL,'','',0,9,32,1),(66,'Movie Screening(2 or 3)','There are few things better in the cold than being in a warm blanket watching a movie',0,0,NULL,NULL,'','',0,9,32,1),(67,'Battle of Waterloo','A battle between the Kings to gain total control over waters of the world.',1,1,4,NULL,'imageuploads/battlewater.jpg','',0,2,33,1),(68,'Junkyard wars','36 hours- Metallic junk and a roaring engine is all you have. Lets see on the battlefield what you turned it into. ',1,1,4,NULL,'','',0,2,33,1),(69,'Full Throttle Grand Prix','Faster, faster, faster, until the thrill of speed overcomes the fear of death.Be ready to showcase your knowledge about engineering behind remote controlled cars and feel the effect of ultimate driving experience.',1,1,5,NULL,'','',1,2,33,1),(70,'India Quiz','A Quiz about our own country. Come and see how much you actually know about her.',1,1,3,NULL,'imageuploads/827.jpg','imageuploads/827_XihZ6Tk.jpg',0,8,34,1),(71,'Dhiti','NA',0,0,NULL,NULL,'','',1,2,35,1),(73,'Link It','A poetic form of \'2048\' which shall give you some words at the end to create a masterpiece!',1,0,1,NULL,'','',0,5,37,1),(74,'Goodbye Earth','Manage all the aspects of a new colony to be settled on Mars.',0,1,100,NULL,'','',0,9,38,1),(75,'Up in the air','To design, fabricate, and demonstrate the flight handling capabilities of an electric powered, radio controlled aircraft that can fly through a given course in the shortest time possible and engage in aerial combat.',1,1,5,NULL,'','',0,2,39,1),(76,'Puts and Punters','Does the prospect of having a cricket team make your heart race? Then participate in Puts and Punters, where you have to create your own virtual cricket team by placing bids on players in an auction. Test your knowledge of cricket and business sense, and build the strongest team.',1,1,4,NULL,'','',0,6,40,1),(77,'Raze and Rise','Test your business acumen and knowledge of the financial universe, by participating in Raze and Rise, a competition in which you have to create and expand your own virtual business, while simultaneously employing strategies to outperform, and even destroy the competing businesses. ',1,1,4,NULL,'','',0,6,40,1),(78,'Wordstock','Play around with words. Trixies, spoonerisms, anagrams!',0,1,1,NULL,'','',0,8,28,1),(79,'Hackathon','An overnight app development event',1,1,4,NULL,'imageuploads/Hackathon.png','imageuploads/Hackathon_J7DLX2p.png',1,3,17,1),(80,'IoT Challenge','Teams get an opportunity to build their own IoT working prototype using tools provided by Texas Instruments. Winners will each get an attractive TI smartwatch.',1,1,4,NULL,'','',0,2,21,1),(81,'Physics of the Impossible','A brain challenging unorthodox quizzing event for Physics enthusiasts. Do you have enough grey matter to explain phenomenons in visuals, gamble on your ideas and hypothesize your own theory?  ',0,0,NULL,NULL,'','',0,8,36,1),(82,'Panorama','Online Photography Contest',0,0,NULL,NULL,'','',0,9,41,1),(83,'Photo Funia','Online Editing Contest',0,0,NULL,NULL,'','',0,9,41,1),(84,'Start-up weekend','TBA',0,0,NULL,NULL,'','',NULL,9,NULL,0),(85,'Mentoring session','TBA',0,0,NULL,NULL,'','',NULL,9,NULL,0),(86,'Paper Presentation','TBA',0,0,NULL,NULL,'','',NULL,9,NULL,0),(87,'YouthCon Mentoring session','TBA',0,0,NULL,NULL,'','',NULL,9,NULL,0),(88,'Youthcon-Convention','LEAP',0,0,NULL,NULL,'','',NULL,9,NULL,0),(89,'Analog Design Contest','TBA',0,0,NULL,NULL,'','',NULL,3,NULL,0),(90,'ADC','TBA',0,0,NULL,NULL,'','',NULL,9,NULL,0),(91,'Airborne','Design and build a Radio Controlled Hovercraft which can complete the maneuverability track in least time. Speed and Control is all that counts!',1,1,6,NULL,'','',0,2,42,1),(92,'Armageddon','TBA',0,0,NULL,NULL,'','',NULL,9,NULL,0),(93,'NDRF exhibition','TBA',0,0,NULL,NULL,'','',NULL,9,NULL,0),(94,'CEERI exhibition','TBA',0,0,NULL,NULL,'','',NULL,9,NULL,0),(95,'Photog Gallery','TBA',0,0,NULL,NULL,'','',NULL,9,NULL,0),(96,'Crac Galleria','TBA',0,0,NULL,NULL,'','',NULL,9,NULL,0),(97,'Demonstration zone','TBA',0,0,NULL,NULL,'','',NULL,9,NULL,0),(98,'Elementary','TBA',0,0,NULL,NULL,'','',NULL,9,NULL,0),(99,'LEAP – Youthcon Panel Discussion','TBA',0,0,NULL,NULL,'','',NULL,9,NULL,0),(100,'Director\'s Panel','TBA',0,0,NULL,NULL,'','',NULL,9,NULL,0),(101,'Mithali','TBA',0,0,NULL,NULL,'','',NULL,9,NULL,0),(102,'Inaug','Inaugration of apogee 2016',0,0,NULL,NULL,'','',NULL,9,NULL,0);
