INSERT INTO `Event_tab` VALUES (5,'<p>&ldquo;You can&#39;t take something off the Internet - it&#39;s like taking pee out of a pool.&rdquo;</p>\r\n\r\n<p>Do u think you have mastered the tools of the internet ?<br />\r\nHere is the perfect event to check out your knowledge of the internet.<br />\r\nUse your knowledge of the internet tools to solve the queries before the timer runs out!</p>\r\n',11,2),(10,'<p>overview for <strong>ahvaan</strong></p>\r\n\r\n<p>&ldquo;Be the change that you wish to see in the world.&rdquo; - Mahatma Gandhi Are you dissatisfied with the state of the world? Do you think you have it in you to be the catalyst for change? If yes, HAS presents an event just for you!</p>\r\n\r\n<p>Ahvaan is a 2 day event which challenges the intellect with real world issues and forces competitors to duke it out with their solutions. The person with the best ideas walks away with the prize.</p>\r\n',49,2),(11,'<p>Test your business acumen and knowledge of the financial universe, by participating in Raze and Rise, a competition in which you have to create and expand your own virtual business, while simultaneously employing strategies to outperform, and even destroy the competing businesses.</p>\r\n',77,2),(12,'<p><strong>APOGEE INNOVATION CHALLENGE 2016</strong></p>\r\n\r\n<p>APOGEE Innovation Challenge, an exceptional technical symposium, aims at quenching your thirst for hands-on experience in real life problems plaguing the industrial world.</p>\r\n\r\n<p>Organized in collaboration with various multinational companies, this event presents before you existing challenges faced by these companies who seek their solutions from you. These problems, which happen to be discipline specific (one need not belong to that discipline), are to be solved by participants in teams of 2-4 in a month. After scrutiny by company officials, top 5 teams will be presenting their final solutions during APOGEE &lsquo;16. Exciting Internship Offers and Cash Prizes await the winners. Needless to say, you can brag about cracking a professional challenge while still being in college. Participation Certificate shall be given to all members of each team which present solutions during APOGEE &lsquo;16.</p>\r\n\r\n<p>The rules which have to be abided by the participants are as given below:</p>\r\n\r\n<ul>\r\n	<li>Participants can form teams of 2-4</li>\r\n	<li>The participants would be given a period of 25-30 from the day of release of the problem statements to&nbsp;work on the problem and revert back.</li>\r\n	<li>The registrations for the preliminary round shall start from 14th of January&nbsp;</li>\r\n	<li>The participants must upload their preliminary solutions in the form desired by the companies&nbsp;(files,report etc) on the portal given on the APOGEE Website by 2nd of February &nbsp;at the latest.</li>\r\n	<li>The preliminary solutions will be scrutinized by the company and the best 5(maybe more) teams are&nbsp;selected .The selected teams have to present a detailed presentation of their solution to the company&nbsp;officials during APOGEE 2016</li>\r\n	<li>Internships or cash prizes will be awarded to the winners by the companies from each category.</li>\r\n</ul>\r\n\r\n<p>&nbsp;For more details&nbsp;visit:&nbsp;http://www.bits-apogee.org/aic</p>\r\n',40,2),(13,'<p>An online event that combines gaming with puzzle solving. The game involves navigating across levels of varying difficulty to find strategically placed clues and solve them with the help of the internet. It promises to be a fun ride with riddles to solve and&nbsp;ciphers to crack.</p>\r\n',56,2),(14,'<p>Rules shall be displayed on the event page</p>\r\n',56,3),(15,'<p>First person to traverse across the levels and solve all the clues wins.</p>\r\n',56,6),(16,'<p>No specific criterion. Anyone can participate</p>\r\n',56,4),(17,'<p>Another event to add to the list of its predecessors The Usual Suspects, Old School and Ceasar&#39;s Box. A strategy-based game that will have the participants involved in different tasks ranging from solving puzzles to procuring items to metaphorical battles.</p>\r\n',55,2),(18,'<p>Anyone can participate</p>\r\n',55,4),(19,'<p>Put your analytical and deduction skills to the test with Treasure Hunt. Rack your brain to solve clues which range from ciphers and poems to props like cryptexes. Follow the clues to locations on campus, each one of which forms a part of an elaborate grand connect.</p>\r\n\r\n<p>An event&nbsp;you should not miss!</p>\r\n',54,2),(20,'<ul>\r\n	<li>No limit on team size</li>\r\n	<li>On-the-spot registration</li>\r\n	<li>First team to solve all the clues wins</li>\r\n</ul>\r\n',54,3),(21,'<p>Anyone can participate</p>\r\n',54,4),(22,'<p>First team to solve all the clues and the grand connect wins.</p>\r\n',54,6),(23,'<p>A new take on the popular TV show &quot;Jeopardy!&quot;. An unconventional blend of fun rounds and trivia quiz. Participants pose their answers in the form of questions.Promises to be a fun event.</p>\r\n',53,2),(24,'<ul>\r\n	<li>There will be three rounds to the quiz- prelims, elims and finals</li>\r\n	<li>Prelims are open to all and reduce&nbsp;the number of participants to 24 who will proceed to the Elimination rounds</li>\r\n	<li>24 teams battle it out in the Elimination round to bring down the number of teams to 4</li>\r\n	<li>The finals, based on the Jeopardy board style, will have a number of rounds with the highest score deciding the winner</li>\r\n</ul>\r\n',53,3),(25,'<p>Prelims are open to everyone</p>\r\n',53,4),(26,'<p>The team with the highest score at the end of the quiz wins</p>\r\n',53,6),(28,'<div>The event consists of 3 rounds which would check the knowledge, resource optimization as well as analytical skills of the contestants.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>The first round checks the knowledge as well as the analytical skills of the contestants. It consists of a crossword puzzle which will contain questions on basic science as well as things covered in your first semester. (It is an elimination round)</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>The second round is a resource optimization round where on the basis of performance in round 1, teams will be given points and on the basis of points they will have virtual money with which they can buy reagents as well as catalysts of different values.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>The third round is that in which teams will get points on the basis of reactions they conduct using their reagents as well as the catalysts they buy. (Points will be given on the basis of heat of reaction) (This is an elimination round)</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>The fourth round is a war round in which teams will be asked questions and if they don&rsquo;t know the answer they can pass the question to other team with loss of points. If the other team is able to answer the question they will gain extra points.</div>\r\n',22,2),(29,'<div>1. 2-3 members per team</div>\r\n\r\n<div>2. All members should be of the same college.</div>\r\n\r\n<div>3. On the spot registration.</div>\r\n\r\n<div>4. No members should be a part of 2 different teams, in such case both the teams will be disqualified.</div>\r\n',22,3),(30,'<p>Open to all</p>\r\n',22,4),(32,'<div>Basic school level pure sciences and some topics from general chemistry course of 1st semester (basic organic, inorganic and physical chemistry).</div>\r\n',22,8),(33,'<p>Bring a pen along with you.</p>\r\n',22,11),(34,'<div>Teams will be shortlisted based on their performance/score in each round. The team with maximum points wins the war.</div>\r\n',22,6),(35,'<p>On-spot registration as well as online registration.</p>\r\n',22,12),(36,'<div>The objective of the teams would be to solve a puzzle over a set of two rounds.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>The first round itself is split into two parts, the first being a written quiz based elimination round consisting OF simple school level pure science lab based questions. The teams that perform the best, move on to the second part where they would be asked to solve a few problem statements based on one of the labs (biology, chemistry or chemical engineering), the solutions to which will help the teams crack further rounds.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>The second round requires the teams to perform real-time lab experiments to unravel more clues, which, along with those collected previously will lead them to the solution to the puzzle.</div>\r\n',21,2),(37,'<div>1. A maximum of two members per team.</div>\r\n\r\n<div>2. On-spot registration.</div>\r\n\r\n<div>3. Participants must wear shoes to the labs.</div>\r\n',21,3),(38,'<p>Anyone</p>\r\n',21,4),(39,'<p>Problem statement will be provided during the event.</p>\r\n',21,7),(40,'<p>Basic school level pure sciences and lab techniques.</p>\r\n',21,8),(41,'<p>Bring a pen along with you.</p>\r\n',21,11),(42,'<p>On-spot registration as well as online registration.</p>\r\n',21,12),(43,'<div>Teams will be shortlisted based on their performance/score in each round.</div>\r\n',21,6),(44,'<div>Problem statement will be provided during the event.</div>\r\n',22,7),(45,'<p>Movie Screening</p>\r\n',66,2),(48,'<p>White Screen<br />\r\nProjector<br />\r\nCarpets to sit<br />\r\nSpeakers</p>\r\n',66,8),(49,'<p>White Screen<br />\r\nProjector<br />\r\nCarpets to sit<br />\r\nSpeakers</p>\r\n',66,11),(50,'<p>A game show based on comic books, mangas and animes</p>\r\n',64,2),(51,'<p>Teams of maximum 3.<br />\r\nNo internet allowed</p>\r\n',64,3),(52,'<p>Microphone<br />\r\nBuzzers<br />\r\nProjector<br />\r\nSpeakers</p>\r\n',64,8),(53,'<p>Microphone<br />\r\nBuzzers<br />\r\nProjector<br />\r\n?Speakers</p>\r\n',64,11),(54,'<p><strong><u>COMICS</u><br />\r\n<br />\r\n1)Guess the movie by their descriptions. In the description the names of the actors have been replaced by popular characters portrayed by them.<br />\r\nExample<br />\r\nBatman and Wolverine fight over who is the better magician.<br />\r\nAns:- Prestige<br />\r\nExample end<br />\r\n<br />\r\na)Batman kills the Joker while discussing about his taste in music<br />\r\nAns:- American Psycho<br />\r\nb)Batman ,Rocket Raccoon and Lois Lane try to con Hawkeye.(Hint:- Batman is involved in a love triangle with Lois Lane and Mystique)<br />\r\nAns:- American Hustle</strong></p>\r\n\r\n<p><strong>c)Alfred sends Catwoman and others on a mission to save the human race.<br />\r\nAns:-Interstellar<br />\r\nd)Alfred sponsors a team which is being undermined by Lucius Fox and investigated by The Hulk<br />\r\nAns:- Now You See Me<br />\r\ne)Ra&rsquo;s al ghul enlists the help of the Mandarin to run a business but gets sentimental after seeing a red coat<br />\r\nAns:- Schindler&rsquo;s List</strong></p>\r\n\r\n<p><strong>f)The Riddler takes Lucius Fox&rsquo;s job to train his dog to use the toilet<br />\r\nAns:- Bruce Almighty</strong><br />\r\n<br />\r\n<br />\r\n2)<strong>Comics to TV Series</strong><br />\r\nGuess these comics which were adapted into tv series<br />\r\n<strong><img src=\"https://lh3.googleusercontent.com/9Gv9LWZjNywkaKGBfsZT74aMJ8zQMQhieuW7SjBnAK5dPTH31CkEIFhduejeb3Bdcp1ZQl89TaEfeMtCLHyymsUK_rCwEqEJMyOfF3l5cnHf-rhDRlXEQ0ZbqAWCghYDC1s8dD4j\" style=\"height:168px; width:300px\" /><br />\r\nAns:-The Tick<br />\r\n<img src=\"https://lh3.googleusercontent.com/7UihbjbTZPCRZPTHAMdz5tH734bPFTJU-6TbbNHLfqcLbMhKtU5hjQqAMl-rBPy95JCEFT5RYeFsG4em5umxBDG9bRg-vY98b3ed2AqrdnVIO-rae-fQ7xzBmj539_o2jkcUP6c9\" style=\"height:267px; width:356px\" /><br />\r\nAns:- Teen Titans<br />\r\n<img src=\"https://lh5.googleusercontent.com/tmRlfhnUrcUrbb-pXmaMmkD44SutYQLOvPjx7ztmSaOMEARBdmCBylA0rO1SRABwcJ6nXR1_OVcGrajnZgpVPmTkupXbJT0QtAj2twFgYaKA7XKexrVxs9aoX69sUt0Tx-TMRRc0\" style=\"height:225px; width:225px\" /><br />\r\nAns:- The Walking Dead<br />\r\n<br />\r\n<br />\r\n<br />\r\n<u>ANIME/MANGA</u><br />\r\n<br />\r\n1)Give translation of some of these common japanese phrases<br />\r\na)Yameru<br />\r\nAns;- stop,halt<br />\r\nb)Ureshii<br />\r\nAns:- Happy<br />\r\nc)Teki<br />\r\nAns:-Enemy<br />\r\nd)Sempai<br />\r\nAns:-One&#39;s senior in an organisation, Sir<br />\r\n<br />\r\n2)Complete family tree<br />\r\n<img src=\"https://lh6.googleusercontent.com/oxNWwCZ045n5fP53x5bM8rvx2bO4f9kF6n5CPyJqT8i6q2klHwN8qDdv0Ce97K8VD4ArQZ-JXS3mbu8pGNda8B03KIPqOMML8FR0lE62tUCbWyy7Tok-Fij-R_CVybCkZxhaITcA\" style=\"height:219px; width:230px\" />&nbsp;<br />\r\n<br />\r\n3)Name the DBZ attack which was named as a pun on X. X literally means &ldquo;Electric Rice Cooker&rdquo;.<br />\r\nAns:- Spirit Bomb, X-Denki Gama</strong><br />\r\n<br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n',64,9),(55,'<p>A game show based on the goof-ups that appear in movies in the form of inaccuracies, plotholes, contradictions etc.</p>\r\n',65,2),(56,'<p><strong>Teams of maximum 3.<br />\r\nNo internet allowed.</strong></p>\r\n',65,3),(57,'<p>Projector<br />\r\nBuzzers<br />\r\nSpeakers<br />\r\nMicrophone</p>\r\n',65,8),(58,'<p>Projector<br />\r\nBuzzers<br />\r\nSpeakers<br />\r\n?Microphone</p>\r\n',65,11),(59,'<p><strong>In this famous continuity error in Friends, we see one of Friends main cast be replaced by a stand-in. Identify the main cast member she was supposed to act as stand-in for, and name the episode(extra points).</strong><br />\r\n<strong><img src=\"https://lh4.googleusercontent.com/zZm_0FHjQu0jgHybDJc_GZkpDygSs3OBQYlNJyvW_K1Qy_i9Q2zRuA8ki5gDepIUZQjkHpBXbrnGM42w59qaPqcoUbEG-Ge692q9yivsmnqaEpqk2Q91GgOsb5m06JhkPRso-gto\" style=\"height:195px; width:356px\" /><br />\r\nAns: Rachel, &quot;The One with the Mugging&quot;<br />\r\n<br />\r\n2) FInd Error in the folllowing pictures from breaking bad<br />\r\n<img src=\"https://lh5.googleusercontent.com/ALM8oKgSQMKRh1kTYDdOHR2xY8MLyXmVHiGVnnz7yMbA_EqYV5LbZHRqzhgvcFh7o2P7CZ6-ukgyoKbx-3lp2DiAZsqK7ixPD70nijOWc6jgT5SzSlilzpRyPZUZ-bRdb2ZlfWev\" style=\"height:168px; width:299px\" /><br />\r\n&nbsp;Ans: Ch is not a chemical element<br />\r\n<br />\r\n3)</strong></p>\r\n',65,9),(60,'<p style=\"text-align:justify\">The competition inherent in the modern market structure forces firms to produce only the best; simultaneously keeping in mind the customer&#39;s needs. Reverse Engineering, as many of you might already have heard of involves going back to a concept from the prototype. This technique is often adopted by organizations while developing new products or improving the existing products. It is also used for studying the technology used by competitors and Market leaders of that Industry. In this competition, the participant has to prove his understanding of fundamental concepts as an engineer. It requires them to have a systematic approach to analyzing and reasoning the engineering design of devices and systems.</p>\r\n\r\n<p>QUIZ PORTAL IS UP. CLICK ON THE FOLLOWING LINK TO START THE QUIZ.</p>\r\n\r\n<p>www.bits-apogee.org/reveng/</p>\r\n\r\n<p>Rohan Jangid +91-9950022672</p>\r\n\r\n<p>Shubham Rathi +91-7728095485</p>\r\n\r\n<p>Himanshu Sharma +91-8504005747</p>\r\n\r\n<p>Or drop a mail at manu-assoc@bits-apogee.org</p>\r\n',60,2),(61,'<ul>\r\n	<li>Registration Rules:\r\n	<ul>\r\n		<li>A team may consist of maximum 5 members (at least 3).</li>\r\n		<li>Students from different educational institutions may form a team.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Event Rules:\r\n	<ul>\r\n		<li><strong>Round 1 (Extended to 14th Feb 2016)</strong>: An <strong>online quiz</strong> based on aptitude, automobile and basic mechanical knowledge.&nbsp;</li>\r\n		<li><strong>Round 2 (18th Feb 2016)</strong>: Qualified teams will be given an <strong>online case study</strong> problem. The teams have to mail (or share) their report/solution to us at manu-assoc@bits-apogee.org.</li>\r\n		<li><strong>Round 3</strong>:&nbsp;The teams will be given a mechanical device (<strong>Declared on the spot</strong>) which they are required to disassemble to the smallest components Note down the Specifications of each component Complete and Engineering Drawing representing the Electrical Circuitry / Major Structural Components (Whatever is Applicable), and then Re-assemble the component.</li>\r\n	</ul>\r\n	</li>\r\n	<li>The organisers will reject incomplete, inconsistent or improper tasks and documents. All entrants are regarded as having the full understanding of the rules and regulations governing the competition. The decision of the jury shall be final and binding. The organisers shall provide various tools required for dismantling the device as well as sheets of paper and other items required for preparing the running note. All disputes are subject to Event Managers&rsquo; Decision.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n',60,3),(62,'<p>The competition is open to all BITSians and all outstation participants.</p>\r\n',60,4),(63,'<p>Teams will be provided with the problem statement for Round 3. This will happen on-the-spot.&nbsp;</p>\r\n\r\n<p>For example,&nbsp;Compressors, 4 Stroke IC Engines were given to study and analyse during &nbsp;previous seasons of APOGEE.&nbsp;</p>\r\n',60,7),(64,'<p>&quot;LINK IT&quot;&nbsp;is a test of creativity and wit. A poetic form of &#39;2048&#39; shall provide you with some words at the end of two minutes&nbsp;given to you.&nbsp;Have a look at the words on screen and&nbsp;let your imagination wreck&nbsp;havoc, use your wit, deploy word play, and create a masterpiece! A poem, a short story,&nbsp;an article or maybe a ballad, if you wish - as long as it is your own, everything will be&nbsp;accepted.</p>\r\n',73,2),(65,'<p>1. The entries can be in English or Hindi.&nbsp;</p>\r\n\r\n<p>2. Each participant shall only get two minutes.</p>\r\n\r\n<p>3. At the end of two minutes, you shall have some words on the screen. The objective of the game is to use those words and write a&nbsp;piece using them.</p>\r\n\r\n<p>4. The word limit (for any entry) is 1500 words, which if exceeded, shall result in&nbsp;</p>\r\n\r\n<p>disqualification.</p>\r\n\r\n<p>5. Word play and interpretation of the topic words (or pictures) shall be&nbsp;</p>\r\n\r\n<p>appreciated but it shall be bound by plausible logic.&nbsp;</p>\r\n\r\n<p>6. Use of profanity shall result in disqualification.&nbsp;</p>\r\n\r\n<p>7. Plagiarism shall result in disqualification.</p>\r\n',73,3),(66,'<p>No eligibility criterion. Anyone and everyone can participate.</p>\r\n',73,4),(67,'<p>Participants shall be judged on the basis of following:</p>\r\n\r\n<p>1. Originality</p>\r\n\r\n<p>2. Ingenious manipulation of Topic words (or pictures)&nbsp;</p>\r\n\r\n<p>3. Literary aspects</p>\r\n\r\n<p>4. Maximum use of words displayed at the end of the game.</p>\r\n',73,6),(68,'<p>Participants can register for this event from APOGEE&#39;16 website.</p>\r\n',73,12),(70,'<ul>\r\n	<li>Round 1: Based on online quiz score.</li>\r\n	<li>Round 2: Based on the online case study (open or closed type).</li>\r\n	<li>Round 3: The basic judging principle is &ndash;\r\n	<ul>\r\n		<li>The more the number of components identified along with proper specifications,more the marks will be awarded.</li>\r\n		<li>Aesthetics and neatness of the disassembly and assembly will be considered too.</li>\r\n		<li>For electrical and electronic devices, a proper electrical circuit diagram is required. For mechanical devices, proper diagram of the basic components with dimensions is necessary.</li>\r\n		<li>The team&rsquo;s skills at innovation and understanding of the task at hand will earn more marks.</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n',60,6),(71,'<p>The following few links would be very helpful in gaining some insight for Reverse Engineering.</p>\r\n\r\n<ul>\r\n	<li>http://en.wikipedia.org/wiki/Reverse_engineering</li>\r\n	<li>http://www.mechanicalengineeringblog.com/tag/reverse-engineering-in-mechanical-parts/</li>\r\n	<li>http://www.wepapers.com/Papers/113526/Reverse_Engineering.ppt</li>\r\n	<li>http://www.npd-solutions.com/reoverview.html</li>\r\n</ul>\r\n',60,8),(72,'<p><strong>Wikipedia</strong>, the holy grail of information. We visit the website more times&nbsp;than we can keep count of. And each time we visit, we sharpen out navigation skills. In fact, we often&nbsp;start at one page and end at another, following&nbsp;hyperlinks, exploring&nbsp;connections&nbsp;between things.</p>\r\n\r\n<p><strong>Wiki-Run</strong>&nbsp;is a game based on the same logic - exploring connections. If you were given&nbsp;two&nbsp;wiki pages, and asked to find a hidden connection between them, will you be able to&nbsp;<strong>find your way</strong> through&nbsp;wikipedia? Will you?</p>\r\n',16,2),(73,'<p>CodeStorm is an on-campus event in which participants need to write code for a given set of problems. The event will mainly focus on the ability of the participants to code problems as quick as they can. The one who solves maximum number of problems correctly in the allotted time shall be adjudged the winner.</p>\r\n',28,2),(74,'<p>&bull; On-Campus event<br />\r\n&bull; Teams of maximum two.<br />\r\n&bull; The contest would be of 3 hours duration.<br />\r\n&bull; The language that will be allowed is C/C++.<br />\r\n&bull; Event will be organised on an online judge.<br />\r\n&bull; The contest would have two rounds:<br />\r\n1. Round&nbsp;1: A preliminary&nbsp;online&nbsp;elimination round.<br />\r\n2. Round 2: An on-campus coding&nbsp;battle<br />\r\n&bull; You may use upto 2 reference books in Round 2.<br />\r\n&bull; Use of internet will not be permitted in Round 2.<br />\r\n&bull; Use of mobile phones or other electronic media will lead to disqualification.</p>\r\n',28,3),(75,'<p>&bull; The team with the maximum score will be declared winner.&nbsp;<br />\r\n&bull; In case of tie, the time of submission will be considered to decide the winner.&nbsp;<br />\r\n&bull; The decision of the judging committee will be final and binding.</p>\r\n',28,6),(76,'<p>You must be an undergraduate/graduate student of the college that you mention.</p>\r\n',28,4),(77,'<p>Do you want to check the verso of coding? Are you fatigued by traditional competitive programming? Do you want a break, out of this coding blas&eacute;? A &lsquo;yes&rsquo; for any of these tells us you are watching the right space. Anti Coding is an on campus event in which participants need to write code unconventionally. To make it much more interesting we choose a theme every year; bend the rules and make ones code a brain teaser for another.This year&rsquo;s theme will be uploaded&nbsp;soon.</p>\r\n',30,2),(78,'<ul>\r\n	<li>On Campus event</li>\r\n	<li>Teams of maximum two</li>\r\n	<li>Use of internet will not be permitted.</li>\r\n	<li>Use of mobile phones or any other electronic media will lead to immediate disqualification</li>\r\n	<li>The event will comprise of 3 rounds</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>The preliminary round aimed at selecting the participants eligible for the next rounds.This round will involve some basic questions on programming and aptitude to ensure a minimum programming capability of the participants required for the next rounds. The teams selected for the next round will be solely selected based on their score in this round.</li>\r\n	<li>A programming round where the contestants will be provided with a set of problemstatements (examples will be soon uploaded). Few of these problems will have a score of +1 for Accepted and zero otherwise. Other problems will be optimization problems having relative scores based on the top scorer normalized on the scale 0 to 2. The event shall include problems in context of this year&rsquo;s theme. The top scoring teams shall qualify for the Final round.</li>\r\n	<li>Final round shall solely be based on this year&rsquo;s theme of Anti-coding. More details of this round will be uploaded soon!</li>\r\n</ol>\r\n',30,3),(79,'<ul>\r\n	<li>The last team to be eliminated is declared winner. In case of tie the number of elimination&nbsp;made by the team will decide the winner.&nbsp;</li>\r\n	<li>In case the tie is still unresolved, the score for the previous rounds will be considered.</li>\r\n	<li>The decision of the judging committee will be final and binding</li>\r\n</ul>\r\n',30,6),(80,'<p>You must be an undergraduate/graduate student of the college that you mention.</p>\r\n',30,4),(81,'<p>The registration portal will be opened soon. The team members need NOT register with APOGEE. This is a pre-apogee online event.</p>\r\n',30,12),(82,'<p>Competitive programming questions similar to ACM &ndash; ICPC regionals. The problems will generally involve regular algorithmic problems on real life situations / mathematical puzzle or similar.</p>\r\n',30,9),(83,'<p>Will be uploaded soon !!</p>\r\n',30,7),(84,'<p>Reason,logic,Rationale and spirit to complete:Do these characterise you? Mind sweeper brings to a plethora of mind-boggling puzzles and vivid games that shall set your heartbeats to a new level.So get ready for a challenge! Come prove yourself .Want to get bonus points? Watch out for puzzles to be posted on facebook page.</p>\r\n',29,2),(85,'<p>Open to all.</p>\r\n',29,4),(86,'<p>The one with highest score wins.</p>\r\n',29,6),(87,'<p>This is a 4 round event, wherein all participants can attempt in all four rounds.</p>\r\n\r\n<p>&bull;Teams of 2.<br />\r\n&bull;On the spot registrations&nbsp;<br />\r\n&bull;Judging criteria by the organising team is final and binding&nbsp;<br />\r\n&bull;Use of internet is strictly prohibited&nbsp;<br />\r\n&bull;Please bring a pen along</p>\r\n',29,3),(88,'<p>An online quizzing event featuring questions spanning various disciplines where a participant gets to progress to the next level only after correctly answering the present.</p>\r\n',31,2),(89,'<ul>\r\n	<li>Single person event.</li>\r\n	<li>You will have to solve a question to proceed to the next question.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n',31,3),(90,'<p>Open to all</p>\r\n',31,4),(91,'<p>The one with highest score wins.</p>\r\n',31,6),(92,'<p>Mobile applications are critical to enable Mobile to deliver value to society.&nbsp;Hackathon is an event where a bunch of developers and designers get together in one space and build things for 12 hours straight code. The objective is to build outstanding applications for winning.&nbsp;</p>\r\n\r\n<p>We&rsquo;ll provide the food, the space, the judges, the mentors, and the prizes; all you have to do is show up with a laptop and a passion for making things.</p>\r\n\r\n<p><br />\r\nWinning teams will get cash prize of Rs.25,000 ,google goodies or&nbsp;an opportunity to pursue a summer internship with NextGen in Bangalore.</p>\r\n',79,2),(93,'<p>1. Duration -12 hrs</p>\r\n\r\n<p>2. Team Size- 4 members (Max.)</p>\r\n\r\n<p>3. Idea must be original.</p>\r\n\r\n<p>More to come ...</p>\r\n',79,3),(94,'<p>Open to all</p>\r\n',79,4),(95,'<p>Innovation, Creativity, Functionality</p>\r\n',79,6),(96,'<p>The Problem Statement will be uploaded 48 hours prior to the begining of the event on&nbsp;&lsquo;Social Apps Hub&#39;. To platform, jointly developed by Vodafone Foundation and NextGen - India&rsquo;s only VC funded technology company in CSR and Sustainability,&nbsp;identifies, reviews and features social apps developed for various organisations and beneficiaries in&nbsp;India. It brings together developers, NGOs, organizations, government and citizens that recognise the&nbsp;potential of mobile technology for social good and further strengthens the delivery in the development&nbsp;ecosystem.</p>\r\n\r\n<p>The&nbsp;Hackathon problem statement will consist of a pressing need in one of the areas of health, education,&nbsp;governance, disability and agriculture.&nbsp;</p>\r\n\r\n<p>Sample Statement<br />\r\nThe &ldquo;Golden hour&quot; is a commonly used term in healthcare - If the patient reaches the hospital within an&nbsp;<br />\r\nhour of his/ her trauma or medical emergency the chances of survival increase greatly. Thus, prompt&nbsp;<br />\r\nmedical treatment has the greatest likelihood of preventing death and rapid intervention is a core&nbsp;<br />\r\nprinciple in trauma cases.&nbsp;<br />\r\nThe most common form of transport to the hospital is an ambulance, however, even with an increasing&nbsp;<br />\r\nnumber of hospitals in urban areas there is no coordination between emergency services and&nbsp;<br />\r\nambulatory agencies. Further, a number of accidents occur on Indian roads in unfamiliar areas making it&nbsp;<br />\r\ndifficult for someone to call the nearest ambulance service or hospital. In this case locational services&nbsp;<br />\r\nthrough GPS could be used effectively to source the nearest hospital or clinic with an ambulatory&nbsp;<br />\r\nservice.&nbsp;</p>\r\n\r\n<p>Objective<br />\r\nThe objective of the App would be to allow patients to access emergency medical care swiftly through&nbsp;<br />\r\nconnecting with hospitals and ambulance services. Further, it would also allow hospitals to be&nbsp;<br />\r\nadequately prepared for incoming traumas by letting them know the nature of the trauma and any relevant areas of the patient&rsquo;s medical history.Thus an app needs to be created that would allow users to connect to the nearest ambulance service at the nearest hospital and request an ambulance. Further, the app could also be used to input data on the nature of the emergency so that the paramedics and emergency response team at hospitals can prepare adequately for the incoming trauma. This would not only allow for the prompt treatment of emergency medical cases but also allow for the trauma team to adequately prepare resources, personnel and treatment options for the incoming emergency.</p>\r\n\r\n<p>App features<br />\r\n1.App should allow users to connect to nearest hospital or ambulatory service. Thus at minimum it would require GPS for locational purposes and for determining the nearest hospital.<br />\r\n2.The app could also be used to select the ambulance service based on the nature of the emergency. For example in the case of a heart attack, an ambulance from a hospital that specializes in heart trauma and surgery could be requested.&nbsp;<br />\r\n3. The app should allow users to then connect to the nearest hospital and request the Ambulance. Thus the app should be able to use GPS to locate the patient and provide the relevant address (house no. etc).&nbsp;<br />\r\n4. The app should allow the user to input the details of the emergency. For example, whether there has been injury, trauma, a car accident, respiratory problems etc. This would allow for the relevant personal from different medical departments to be engaged for the arrival of the ambulance.&nbsp;<br />\r\n5. The app could also examine the ability to input the details of the Patient&rsquo;s medical record. Any allergies and important notes could be noted and shared with the emergency response team before the patents arrival.</p>\r\n',79,7),(97,'<p>It is a complete day and night event wherein the participants are required to make a vehicle from the junk provided to them in 36&nbsp;hours in the final round. For this purpose, the BITS Workshop will be kept open during the complete event and&nbsp;participants can make use of the required machine tools. The teams will be selected for the final round from two initial&nbsp;rounds.&nbsp;</p>\r\n',68,2),(98,'<p>There are no pre-requisites for this event. Any one can form a team and take part in it.</p>\r\n',68,4),(99,'<p>The final vehicle will be judged on the following basis:</p>\r\n\r\n<p>1. Its ability to work properly.</p>\r\n\r\n<p>2. Manufacturing of the required mechanism as per the problem statement.</p>\r\n\r\n<p>3. Ability to finsh the final task required to be done by all the teams.</p>\r\n\r\n<p>Rules will be specifically be explained at the time of event and the above order does not signify any particular weigtage to the points mentioned.</p>\r\n',68,6),(100,'<p>All the resources will be provided from the Mech. Engg. Assoc. The junkyard will be kept open for the participants.&nbsp;</p>\r\n',68,8),(101,'<p>The first round will be an MCQ type. The questions will be based on basic&nbsp;engineering concepts and will also be related to automobiles in particular.</p>\r\n\r\n<p>The second round will be an more of an imaginative and open end type where the shortlisted teams will be required to present a solution to the given problem statement. The problem would be based on a hypothetical situation and the participants are required to showcase their know-how in the current technology as well as their thinking ability to depict a solution to the given problem.</p>\r\n',68,9),(102,'<p>IC engine gives life to dead beasts. As the otto cycle spins,it unleashes the power and pumps in adrenaline which will leave you trembling. Incur the fury of otherwise pissed off pistons and blazing sounds generating smoke,catching fierce speeds and out-throttling each other for their mark at the podium.&nbsp;</p>\r\n\r\n<p>On the course of F1 racing, BITS-Pilani is proud to present&nbsp;Remote Controlled racing event the&nbsp;&quot;Full Throttle Grand Prix&rdquo;. This competition is to show your knowledge about engineering behind remote controlled cars and feel the effect of ultimate driving experience.&nbsp;Come and showcase your own beast machine at Full Throttle Grand Prix.</p>\r\n',69,2),(104,'<p>Rules:</p>\r\n\r\n<p>1. Competition rules:&nbsp;</p>\r\n\r\n<ul>\r\n	<li>&nbsp;The minimum width of the track will be 80 cm.</li>\r\n	<li>&nbsp;The track will have check points at regular intervals.</li>\r\n	<li style=\"text-align:justify\">&nbsp;If a machine tumbles, or halts, or goes off the arena at any point on the track, only one of the participants is allowed to lift it &nbsp; &nbsp;up and place it at the nearest checkpoint behind that point. (Rule No (ii) &amp; (iii) are for non-racing rounds. The rules for &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;racing round will be told on the spot)</li>\r\n	<li>&nbsp;The vehicles have to be fully controlled using only the remote control unless there is a need to touch the vehicle as stated &nbsp; &nbsp;above. There will be a time penalty every time the machine requires lifting by the team member.</li>\r\n	<li>&nbsp;Any vehicle is not allowed to leave any disintegrated part on the race track amidst of the race. In case this happens, the &nbsp; &nbsp; &nbsp; &nbsp;team will be disqualified.</li>\r\n	<li>&nbsp;The teams are also not allowed to damage the opponent&#39;s vehicle deliberately. If found guilty, the accused team will be &nbsp; &nbsp;disqualified.</li>\r\n	<li>&nbsp;Teams may consist of a maximum of 5 members.</li>\r\n</ul>\r\n\r\n<p>2. General Rules:&nbsp;</p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">&nbsp;Depending on the number of teams participating and other time constraints, the arena will be given to the participants for &nbsp; &nbsp;practicing. The time slots will be given on the basis of first come first serve basis, but little duration for practising &nbsp;is&nbsp;assured&nbsp;to everyone.</li>\r\n	<li>&nbsp;All the teams must have a team name.</li>\r\n	<li>&nbsp;Organizers reserve the right to change any of the above rules. The participants will be informed about the same through the &nbsp;highlighted text on APOGEE website.</li>\r\n	<li>&nbsp;Participants can address their queries indirectly via e-mail or forum and directly by calling up the organizers.</li>\r\n	<li>&nbsp;Some online resources for help will be uploaded soon.</li>\r\n	<li>&nbsp;Organizers and judges&rsquo; decision shall be considered as final and binding on all.</li>\r\n</ul>\r\n',69,3),(106,'<p>Inheriting its name from a popular BBC Radio show of the same name, JAM (Just A&nbsp;Minute) is a speaking event where participants talk, for as long as they can, on a given topic -&nbsp;until they make a mistake, which other participants can object to. The event is&nbsp;not only&nbsp;a test of your English-speaking capabilities, but is also a challenge&nbsp;to be as&nbsp;entertaining as possible, for the sake of both the audience and the speakers on stage. JAM makes its debut in&nbsp;APOGEE this year. So,&nbsp;turn up and stand a chance to make history!</p>\r\n',41,2),(107,'<p>Vehicle Specifications&nbsp;</p>\r\n\r\n<ul>\r\n	<li>The vehicle should fit in a box of dimensions 800mm X 700mm X 600mm at every given point of time in the race. The external device used to control the vehicle is not included in the size constraint.</li>\r\n	<li>The use of IC Engines for propulsion is essential. Motors should not be used for this purpose. However DC motors and servos can be used for steering mechanisms or any other mechanism apart from propulsion.</li>\r\n	<li>Only one IC engine should be used in the vehicle. Use of any other sources such as chemicals, compressed gas, rockets etc for propulsion is not allowed. The maximum allowed capacity of IC engine to be used is 4.6 cc (i.e. Participants can also use 4.2cc, 3.5cc, 2.5cc, or any other IC engine with less power).</li>\r\n	<li>The vehicle has to be necessarily controlled by a wireless remote control system throughout the competition. The vehicle must have two remote control of different frequencies or an alternate frequency remote control circuit which can be switched to either frequency before the start of the game. This is done to avoid frequency interference between the two competing vehicles.</li>\r\n	<li>Remote control systems from toys might be used. Remote control systems available in the market may also be used.</li>\r\n	<li>The vehicle parts can be ready made. But there will be extra points if you make chassis and steering mechanism by yourself (See judging criteria for more detail).</li>\r\n	<li>&nbsp;If you are making your car then other functional parts like motors and servos, gears, springs, engine, remote control &nbsp;systems, batteries, wheels, braking mechanism are allowed to be used as directly available from the market.</li>\r\n	<li>&nbsp;The vehicle must have an onboard power supply to provide electricity to any mechanism requiring electric power.</li>\r\n	<li>&nbsp;The electric voltage anywhere in the machine should not be more than 12V at any point of time.</li>\r\n	<li>&nbsp;Participants are advised to use a proper cooling mechanism to prevent overheating of the engine.</li>\r\n	<li>&nbsp;Verify with the organizers if you have the slightest doubt whether a component can be used or not.</li>\r\n</ul>\r\n',69,5),(108,'<ul>\r\n	<li>The judging is divided in two parts: (a) Design Event (25%) (b) Racing Event (75%)</li>\r\n	<li>In the design event, a panel of judges will be judging the vehicle on the designing part. However, this is applicable to only those teams who have themselves designed and fabricated the steering system and chassis of the vehicle. Teams bringing the readymade cars will have their evaluation in 75% of total marks i.e. the team loses 25% marks straightaway.</li>\r\n	<li>In the racing event, the control of the vehicle and the driving skill of the participant will be the judging parameter. The track will consist of sharp turns and a little elevation also.</li>\r\n	<li>Lap time will be another criterion to decide the winner.</li>\r\n</ul>\r\n',69,6),(109,'<ul>\r\n	<li>Participants need to speak without any errors, the types of which will be explained in detail prior to the JAM.&nbsp;</li>\r\n	<li>To get the&nbsp;general idea, errors include, among many others,&nbsp;hesitation, speech defects, repetition, logical inconsistencies, plagiarism and, most fundamentally, grammatical errors.</li>\r\n	<li>When a speaker makes an error, other speakers can object and get to speak, if their objections are valid.</li>\r\n	<li>The length of one round equates to 1&nbsp;minute of speaking time.</li>\r\n	<li>Points are awarded for the duration of speaking time and for the correct objections made. The scoring system will also be explained during the JAM.</li>\r\n	<li>The event will consist of preliminary rounds of six to eight speakers from which the best&nbsp;handful will move on to the final.</li>\r\n</ul>\r\n',41,3),(110,'<p>Build a Remote Controlled IC engine powered car to traverse a race track in the minimum possible time. The time trial track may be composed of several turns with increasing difficulty levels. The teams with the top best time to lap this track qualify for racing. Final round will be a race.</p>\r\n',69,7),(111,'<ul>\r\n	<li>&#39;Mod is God.&#39; All decisions made by the moderator (or judge) are final.</li>\r\n	<li>In the case of any discrepancies, refer to the above rule.&nbsp;</li>\r\n	<li>Winners will be decided based on the total number of points scored. &nbsp;</li>\r\n</ul>\r\n',41,6),(112,'<ul>\r\n	<li>Registration is on-the-spot.</li>\r\n	<li>Individual participation.&nbsp;</li>\r\n</ul>\r\n',41,12),(113,'<p>Only the best of BITS shall emerge victorious in this highlight quiz of APOGEE. Compete with slatwarts to etch your name in the BITSian Quizzing Hall of Fame.&nbsp;</p>\r\n',42,2),(114,'<ul>\r\n	<li>Lone Wolf.</li>\r\n	<li>Bring a pen.</li>\r\n</ul>\r\n',42,3),(115,'<p>This event is ONLY&nbsp;for BITSians.&nbsp;</p>\r\n',42,4),(116,'<p>Registration is on-the-spot.</p>\r\n',42,12),(117,'<p>Participants have to submit an abstract giving the complete description of their vehicles based on the following lines.&nbsp;</p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">&nbsp;If the teams are fabricating the vehicle by themselves then steering mechanism and the chassis layout should be explained &nbsp;in detail, along with proper diagrams. Picture(s) showing all the three should be attached.</li>\r\n	<li style=\"text-align:justify\">&nbsp;Photographs of chassis without assembly should also be submitted. If the participants have already proceeded building &nbsp;their chassis, then they can send the photo of their car in the current state. These photographs are required to verify that &nbsp; &nbsp;the components have been built by the participants&nbsp;themselves.</li>\r\n	<li style=\"text-align:justify\">&nbsp;Photograph of the car in the current state must also be sent with the name of the photograph as the date on which it is &nbsp;taken.</li>\r\n	<li style=\"text-align:justify\">&nbsp; Specification of all other components like the engine, remote controllers etc must be specified.</li>\r\n	<li style=\"text-align:justify\">&nbsp; The complete abstract along with the photos and the team name and members name.</li>\r\n	<li style=\"text-align:justify\">&nbsp; If readymade cars are used by the team then the team should mail the exact specification of the car.</li>\r\n	<li style=\"text-align:justify\">&nbsp; Write the name of team along with the name of team leader and team members with contact numbers and e-mail ids. Put &nbsp; &nbsp; the &lt;team name&gt;_&lt;College&gt;_FTGP in the subject and mail your abstract to meaapogee@gmail.com .</li>\r\n	<li style=\"text-align:justify\">&nbsp; A confirmation mail will be sent to the Team leaders.</li>\r\n</ul>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n',69,12),(118,'<p>Think you know it all? Test how you would fare against the best in this open-to-all quiz, about anything under the sun.</p>\r\n',43,2),(119,'<ul>\r\n	<li>Teams of 3 or less.&nbsp;</li>\r\n	<li>Bring a pen.</li>\r\n</ul>\r\n',43,3),(120,'<p>Registration is on-the-spot.</p>\r\n',43,12),(121,'<p>Whether you&#39;re proud of your scientific achievements or you know everything there is to know about the latest smartphone, this quiz is for you.</p>\r\n',44,2),(122,'<ul>\r\n	<li>Teams of 3 or less.</li>\r\n	<li>Bring a pen.</li>\r\n</ul>\r\n',44,3),(123,'<p>Registration is on-the-spot.</p>\r\n',44,12),(124,'<p>In this battle of words against the clock, quick thinking (and a bit of luck) will make you the champion. Revel in the madness of Scrabble, now with extra adrenaline!</p>\r\n',45,2),(125,'<ul>\r\n	<li>The rules of the game follow those of conventional Scrabble, with a time limit.</li>\r\n	<li>Individual participation only.</li>\r\n	<li>Games are played one-on-one in a knockout format.</li>\r\n	<li>Any additional rules will be explained prior to the game.</li>\r\n</ul>\r\n',45,3),(126,'<p>Registration is on-the-spot.</p>\r\n',45,12),(127,'<p>Business Master&nbsp;is an event&nbsp;to identify the leadership skills based on a management basis rather than a resume or interview one. This event challenges the participants&#39; ability to think, guts to perform under enormous duress, and calls into question their skills in creativity, entrepreneurial spirit, business knowledge, stamina, teamwork and communication.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Abhishek Dixit</p>\r\n\r\n<p>+91-7728086586</p>\r\n\r\n<p>Utsav Shukla</p>\r\n\r\n<p>+91-7728086700</p>\r\n\r\n<p>&nbsp;</p>\r\n',35,2),(128,'<p>Open to all.</p>\r\n',35,4),(129,'<p>The event will be held&nbsp;on campus during Apogee, and will have business quizzes, guesstimate questions and case studies.You don&#39;t need to have any hardcore knowledge of Economics, Finance or Business.&nbsp;If you love businesses, read newspaper and keep a track on latest happenings in the world, you can certainly perform well.</p>\r\n\r\n<p>Round 1: Business Quiz</p>\r\n\r\n<p>Quiz consisting of questions from the world of Economics, Finance and Business.</p>\r\n\r\n<p>Round 2: Case study</p>\r\n\r\n<p>A scenario would be given in form of case study and questions based upon it will be put up.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n',35,5),(130,'<p>We will judge your case solution on your analytical thinking, structured approach, innovativeness and feasibility.&nbsp;</p>\r\n',35,6),(131,'<p>An event that tests your calibre to earn out of your earnings, to make money out of money.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Abhishek Dixit</p>\r\n\r\n<p>+91-7728086586</p>\r\n\r\n<p>Harmeet Lamba</p>\r\n\r\n<p>+91-8503989380</p>\r\n',36,2),(132,'<p>Prove that you are master of the markets by playing the online round by trading with real-time prices. People who clear this round get to play the final round, where they get to trade on a LIVE TRADING FLOOR on campus!!! Exciting prizes up for grabs.&nbsp;</p>\r\n\r\n<p><strong>Online round ends on : 23rd February, 2016.</strong></p>\r\n',36,3),(133,'<p>Player with the highest portfolio value at the end of final round is declared the winner</p>\r\n',36,6),(134,'<p>Opent to all.</p>\r\n',36,4),(135,'<p>Does the prospect of having a cricket team make your heart race? Then participate in Puts and Punters, where you have to create your own virtual cricket team by placing bids on players in an auction. Test your knowledge of cricket and business sense, and build the strongest team.</p>\r\n',76,2),(136,'<p>&nbsp;</p>\r\n\r\n<p>A monopoly game with a lot of twists and turns!!! Do you have the ability and luck to gain a monopoly in a bitsian world and be the king by owning most of the assets?</p>\r\n\r\n<p>Abhishek Dixit</p>\r\n\r\n<p>+91-7728086586</p>\r\n\r\n<p>Yash Tyagi</p>\r\n\r\n<p>+91-8239083591</p>\r\n',34,2),(137,'<p>Show us your economic, mathematical and logical skills in the first round. Then advance to the bitsopoly round.</p>\r\n',34,3),(138,'<p>Open to all.</p>\r\n',34,4),(139,'<p>Player with the most assets at the end is declared the winner.</p>\r\n',34,6),(140,'<p><strong><span style=\"color:#FF0000\">Are you eager to gamble in the crowd ?So here comes the opportunity!!</span></strong></p>\r\n\r\n<p>Come with your team (of max 2),participate in the GAMBLING rounds and show your skill&nbsp;to gamble in&nbsp;real time.</p>\r\n\r\n<p>The event promises fun,thrill and ofcourse GAMBLING experience!!</p>\r\n',61,2),(142,'<ul>\r\n	<li>Anyone is eligible for this event, all you should know is- <span style=\"color:#008000\">How well you can handle your money(points in this event!).</span></li>\r\n	<li>You need not know rules of&nbsp;Gambling as they&nbsp;would be told on spot at the event.</li>\r\n</ul>\r\n',61,4),(143,'<ul>\r\n	<li>Come in teams of maximum 2</li>\r\n	<li>You cannot use internet during the event. If any team is found guilty, it will be disqualified.</li>\r\n	<li>In any case of any conflict the final decision will be of&nbsp; the event coordinator.</li>\r\n</ul>\r\n',61,3),(144,'<ul>\r\n	<li>First round will be an elimination round</li>\r\n	<li>The team&nbsp;with maximum money(points) at the end of the event will be declared as winner.</li>\r\n</ul>\r\n',61,6),(145,'<ul>\r\n	<li>The event will be conducted in two rounds,&nbsp;with participants in teams(max of 3).</li>\r\n	<li>The first round (Eliminations) will be a gambling session where teams will gamble on&nbsp;mathematics related questions&nbsp;on an online interface.</li>\r\n	<li>&nbsp;The aim is&nbsp;to score as high as possible. The second round will be a gamble session on&nbsp;Mathematical&nbsp;Puzzles that require some&nbsp;tricks.&nbsp;</li>\r\n</ul>\r\n',61,7),(147,'<ul>\r\n	<li>You can register online for this event(can register as teams or can join a team).</li>\r\n	<li>On the spot registrations are also available for this event.</li>\r\n</ul>\r\n',61,12),(148,'<p>Mathematics eat brains and so do ZOMBIES!!</p>\r\n\r\n<p>Survive in Mathematical zombie battle-An event where you can completely eat up opponent&#39;s mind by answering tricky questions and restricting&nbsp;their moves.</p>\r\n\r\n<p>Be a ZOMBIE and carry away brains!!</p>\r\n',62,2),(149,'<ul>\r\n	<li>Come in teams of maximum 2</li>\r\n	<li>You <span style=\"color:#FF0000\">cannot </span>use internet or mobile phones&nbsp;during the event.&nbsp;If any team is found guilty, it will be disqualified.</li>\r\n	<li>In&nbsp;case of any conflict the final decision will be of&nbsp; the event coordinator</li>\r\n</ul>\r\n',62,3),(150,'<ul>\r\n	<li>The team that will survive&nbsp;in&nbsp;the battle&nbsp;with all the other participating&nbsp;teams,will be the ZOMBIE of the event.</li>\r\n	<li>The most resistant zombie will be declared as winner.&nbsp;</li>\r\n</ul>\r\n',62,6),(151,'<p>&ldquo;Any fool can write code that a computer can understand. Good programmers write code that&nbsp;humans can understand. &rdquo; ~ Martin Fowler. &nbsp;Do u think you have mastered the art of&nbsp;competitive coding? Maybe you need to reconsider! Well here is an event that will challenge&nbsp;your coding skills and make you bite your nails! BITS Pilani presents ICL, International&nbsp;Coding League, a computer programming competition based on the pattern of ACM-ICPC&nbsp;this Apogee 2016. On February XXth, we&#39;re gathering some of the best minds in the country&nbsp;to compete for the top spot.</p>\r\n\r\n<p>Kapil Singhal 9782608518 Saurabh Bansal 8824061393</p>\r\n',10,2),(152,'<p>This is a team event. You either need to create a new team or join an already Existing one...</p>\r\n',10,12),(153,'<p>1. The contest is divided into two phases.</p>\r\n\r\n<p>2. Participants must participate in teams of two.</p>\r\n\r\n<p>3. The first phase is held online nationwide.</p>\r\n\r\n<p>4. Qualifying participants will be called on campus for the final phase.</p>\r\n\r\n<p>5. Duration of the final round is 3 hours.</p>\r\n\r\n<p>6. Judging is done using an automated judge.</p>\r\n\r\n<p>7. Any form of malpractice shall lead to disqualification of the team(s).</p>\r\n\r\n<p>8. The decision of the authorities shall be final and binding.</p>\r\n',10,3),(154,'<p>All the students studying in undergraduate colleges in India are eligible for the prizes.</p>\r\n',10,4),(155,'<ul>\r\n	<li>It will be an online game where two teams will be playing against each other.</li>\r\n	<li>The motive of each team will be to answer questions on&nbsp;each of its move in order&nbsp;to restrict other&#39;s way. &nbsp;</li>\r\n	<li>The team that will survive till end, will be the ZOMBIE of the event!</li>\r\n</ul>\r\n',62,7),(156,'<p>The participants are expected to solve certain algorithmic problems using either of C, C++ or&nbsp;Java only.</p>\r\n',10,7),(157,'<p>Sample contest problems can always be viewed at:</p>\r\n\r\n<p>1. http://www.codechef.com/</p>\r\n\r\n<p>2. http://www.spoj.com</p>\r\n',10,8),(159,'<p>An automated judge shall test the output of your code against the standard test cases. Your&nbsp;code&#39;s runtime should not exceed a maximum limit. Maximum RAM that you can use is 256&nbsp;MB.</p>\r\n',10,6),(160,'<p>Online as well as&nbsp;On spot registrations will be there.</p>\r\n',62,12),(161,'<p><span style=\"color:#0000FF\"><span style=\"font-size:14px\">Open for all those who want to witness a zombie apocalypse.</span></span></p>\r\n',62,4),(162,'<p>Attend and make&nbsp;your attendance count!&nbsp;Join the entire APOGEE online event and win Exciting prizes.</p>\r\n\r\n<p>The online portal will be activated from 1.30 am every day (for fixed 2 hours) and will have questions from all the events that have&nbsp;happened on the same day, answer them as fast as possible ,&nbsp;gain points and maximize your score upto&nbsp;the last day!!!&nbsp;&nbsp;</p>\r\n',63,2),(163,'<ul>\r\n	<li>It is an online event .</li>\r\n	<li>The portal will be active for 2 hours.</li>\r\n	<li>Portal will open only at 1:30 am.</li>\r\n	<li>All cases of not being able to attempt&nbsp;questions due to time limit will not be&nbsp;considered.&nbsp;<strong>(&nbsp;BE AS&nbsp;QUICK&nbsp;AS POSSIBLE!!)</strong></li>\r\n	<li><strong>NO BUFFERS</strong> in quizzes :P. The winner will be the one with maximum cumulative&nbsp;marks of all the quizzes. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;(Please refer to the JUDGING CRITERIA for the same.)</li>\r\n</ul>\r\n',63,3),(164,'<p>Anyone looking&nbsp;to WIN exciting prizes!</p>\r\n',63,4),(165,'<p>Each day of apogee will have a quiz at midnight.</p>\r\n\r\n<p>The winner will be the one with<strong> maximum points</strong> including those&nbsp;of all the quizzes&nbsp;till last day.<strong><span style=\"color:#FF0000\">(NO BUFFERS!!!)</span></strong></p>\r\n\r\n<p>The winner will be declared on the last day of apogee.</p>\r\n',63,6),(167,'<ul>\r\n	<li>Solve the sudoku using the hints which are derived from the C code.</li>\r\n	<li>Dry run the C code to get values and fill in your Sudoku.</li>\r\n	<li>A fun event exploring C language differently.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n',27,2),(168,'<ul>\r\n	<li>Complete the sudoku by solving simple C lang. snippets within given time.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n',27,3),(169,'<ul>\r\n	<li>All are eliglble.</li>\r\n	<li>Those who know how to solve sudoku and C-language problems are most welcome.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n',27,4),(170,'<ul>\r\n	<li>Need to solve sudoku with C-language snippets in given time.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n',27,5),(171,'<ul>\r\n	<li>Judging will be based on the extent to which sudoku is solved and on the time taken to solve it</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n',27,6),(172,'<p>This event has 3 rounds spread over 2 days.</p>\r\n\r\n<p>&nbsp;Day 1: Round 1: Written eliminations(A short written quiz).</p>\r\n\r\n<p>&nbsp;Round 2: Extempore on various topics each concerning a burning social issue.</p>\r\n\r\n<p>&nbsp;Day 2: Round 3: Participants selected after round 2 will be given a topic which they have to present in this round. They can use any means (PowerPoint, Videos, etc) to present their content with a time limit of 5 minutes. Here they are required undertake research on the problem and provide a viable solution; solution being the main focus.</p>\r\n',49,3),(173,'<p>&nbsp;on spot registration. This is an individual-centric event</p>\r\n',49,4),(174,'<ul>\r\n	<li>Sudoku and C-language snippets will be given.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n',27,7),(175,'<ul>\r\n	<li>Sudoku and C-language snippets and a sheet for rough work&nbsp;will be given.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n',27,8),(176,'<p><img alt=\"\" src=\"https://fbcdn-sphotos-e-a.akamaihd.net/hphotos-ak-xat1/v/t1.0-9/1560482_840425322641171_928881243_n.png?oh=7f7a8c7eb6c533d2a6e46aafd93233fb&amp;oe=570DC351&amp;__gda__=1464401436_e1dcfccad6c8607c8039005d40fed3df\" /></p>\r\n',27,9),(177,'<p>Do you feel that you know everything about your mother tongue? Think speaking in Hindi is child&#39;s play? For those who do, Hindi Activities Society presents Word-A-Maze, an event that challenges your Hindi vocabulary in a creative and innovative manner.</p>\r\n',50,2),(178,'<ul>\r\n	<li>NO specifications</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n',27,10),(179,'<ul>\r\n	<li>&nbsp;</li>\r\n</ul>\r\n',27,11),(180,'<ul>\r\n	<li>No registration required</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n',27,12),(181,'<p>&bull; There will be written as well as interactive stage rounds.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &bull; Registration will be done on the spot.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &bull; Come in teams of 2.</p>\r\n',50,3),(182,'<p>Online registrations only.</p>\r\n',63,12),(183,'<p>Wordstock is an event to be at if you are good with words. The participants are given different kinds of word puzzles like trixies, spoonerisms, etymology based questions, anagrams and crosswords to solve over a given period of time. The myriad of puzzles tests one&#39;s logic, creativity and&nbsp;vocabulary while being fun to solve.</p>\r\n',78,2),(184,'<p>Teams of two. Bring a pen along.</p>\r\n',78,3),(185,'<p>Open to all</p>\r\n',78,4),(186,'<p>Each section has a marking scheme. The team with the highest score wins.</p>\r\n',78,6),(187,'<p>3 days online Android hackathon wherein a problem statement will be given and you have to submit your ideas as well as your app&nbsp;on it.</p>\r\n',47,2),(188,'<ul>\r\n	<li>Max In Teams of 3</li>\r\n	<li>Your submission should solve the problem statement given</li>\r\n	<li>You have to submit your app as well as source code</li>\r\n	<li>Decision of judges will be final</li>\r\n</ul>\r\n',47,3),(189,'<p>Open for all in max teams of 3</p>\r\n',47,4),(190,'<p>Submissions will graded on the basis of :</p>\r\n\r\n<ul>\r\n	<li>Your final apk</li>\r\n	<li>how well it covers the problem statement</li>\r\n	<li>presentation</li>\r\n</ul>\r\n',47,6),(191,'<p>It&#39;s the year 2050.&nbsp;Humans have left Planet Earth and are trying to build a colony on Mars. Your team is incharge of this settlement and thus you have to take care of various aspects of this new colony.&nbsp;</p>\r\n',74,2),(192,'<p>Categories: Education, Social, Fun, Productivity</p>\r\n',47,7),(193,'<p>Following details required</p>\r\n\r\n<ul>\r\n	<li>Details of every member</li>\r\n	<li>team name</li>\r\n</ul>\r\n',47,12),(194,'<p>1. Participants have to come in teams of 3-6 only.</p>\r\n\r\n<p>2. Resources will be provided at the time of the event. Participant need only carry Aptitude and Attitude to win.</p>\r\n\r\n<p>3. In case of discrepancy, verdict&nbsp;of organizers is final and binding.</p>\r\n',74,3),(195,'<p>There will be four rounds in the event which will be declared then and there. A cumulative score of the participants will be calculated based on their points in each round.</p>\r\n',74,6),(196,'<p>On-spot registrations.</p>\r\n',74,12),(197,'<p>Does the words robots,automation and image processing excite you.</p>\r\n\r\n<p>Then we have just the right event for you, \r\nIstrike :&nbsp;build a robot capable of moving on a maze, avoiding obstacles and pave its way to the destination.</p>\r\n',38,2),(198,'<p><u>Robot Specifications</u></p>\r\n\r\n<p>&bull; The bot must fit into a cube of 20 cm x 20 cm x 20 cm at all times. It may not expand at any point during its run beyond these dimensions.</p>\r\n\r\n<p>&bull; The participants are suggested to paint their bots black in colour on top for proper detection and processing.</p>\r\n\r\n<p>&bull; The power supply for the bot should not exceed 24V between any two points in the circuit.</p>\r\n\r\n<p>&bull; The bot must be fully independent, with motoring mechanisms self-contained. However, it can communicate with the computer using either wired or wireless data transfer and can use external power supply. The length of wired will not be included in the size of the bot if it is wired.</p>\r\n\r\n<p>&bull; The robotic equipment is to be fully autonomous. Human operators are not permitted to enter any information into the equipment during a run.</p>\r\n\r\n<p>&bull; The human operator should not directly control the motion of their robots with a joystick or by keyboard</p>\r\n\r\n<p>commands under any circumstance.</p>\r\n\r\n<p>&bull; The bot cannot be built of ready-made toys or Lego kits. But ready-made motor drive circuits, development boards or communication interfaces can be used.</p>\r\n\r\n<p>&bull; Any robot that is deemed by event organizers to be harmful or damaging to either people or the track will be disqualified immediately.</p>\r\n\r\n<p> In case of any discrepancies/disputes the decision of organizers will be final and binding.</p>',38,3),(199,'<p>&bull;All students eligible for participation in APOGEE 2016&nbsp;are eligible for participation in this event.</p>\r\n\r\n<p>&bull;However, each team has to register for the event in advance. No abstracts are to submitted for the event.</p>\r\n\r\n<p>&bull;Maximum team size is 4.</p>\r\n\r\n<p>&bull;Students from different educational institutes are allowed to collaborate to form a team.</p>\r\n\r\n<p>&bull;A given student can be part of a maximum of 1 team.</p>\r\n',38,4),(200,'<ul>\r\n	<li>Preference would be given to the bots which complete the entire track.</li>\r\n	<li>If the bot at any time, loses track. It should start from beginning. Each team would be given two chances with a penalty.</li>\r\n	<li>&nbsp;Exact scoring charts (including penalties) will be made available in due course of time and uploaded on the website.&nbsp;&nbsp;&nbsp;</li>\r\n	<li>In case of tie, the bot which completed the track fastest wins.</li>\r\n</ul>\r\n',38,6),(202,'\r\n<p>&nbsp;</p>\r\n\r\n<p><u>Arena Specifications</u>&nbsp;<br />\r\n<br />\r\nThe arena images are available in &lsquo;Resources&rsquo; tab&nbsp;<br />\r\n<br />\r\n<u>Round 1</u>:&nbsp;<br />\r\n<br />\r\n&bull; The width of the moving lane would be 30 cms everywhere.&nbsp;<br />\r\n&bull; The arena is a maze and participants are expected to pave a path from start to finish using image processing. &nbsp;<br />\r\n&bull; The start point is marked as a red block and finish point as a blue strip adjacent to a green block.<br />\r\n&bull; The rest arena is a black and white maze , white being the path to traverse on.<br />\r\n<br />\r\n<u>Round 2</u>:&nbsp;<br />\r\n<br />\r\nThe particpants have to move their bot on the path paved by them in round 1.<br />\r\n<br />\r\nThe bot completing the task in the least time wilthout fouls will be declared as the winner.\r\n<br />\r\n&nbsp;</p>\r\n<p>&nbsp;</p>\r\n',38,10),(203,'<p>No prerequisites required.</p>\r\n',11,4),(204,'<p>&bull;Duration of the final round is 3 hours(tentative).&nbsp;<br />\r\n&bull;Any form of malpractice shall lead to disqualification of the team(s).&nbsp;<br />\r\n&bull;The decision of the authorities shall be final and binding.</p>\r\n',11,3),(205,'<p>This event involves using the internet and the tools availble on it to solve problems.&nbsp;</p>\r\n',11,7),(206,'<p>&bull; Registration will be done on the spot on first come first serve basis.<br />\r\n&bull; Participants must participate in teams of two.</p>\r\n',11,12),(207,'<div><big><var><span style=\"font-size:18px\">&quot;Creativity is an elusive construct&quot;</span></var></big></div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<p><samp><big><code><span style=\"font-size:18px\">All those dumb-charades lovers, here is an event for you...come, unleash the &quot;creative coder&quot; inside you in this fun&nbsp;game , PICTIONARY<br />\r\nGet your teammates to correctly guess the word by animating it through a piece of code.</span></code></big></samp></p>\r\n',12,2),(208,'<p><u>GamePlay</u></p>\r\n\r\n<p>The competition consists of two rounds. The first round is an elimination round. On the basis of the points obtained in round 1, the top teams advance to round 2.</p>\r\n\r\n<p>Round 1</p>\r\n\r\n<p>&bull; The participants will be given the image of the final track and a path has to paved from start to finish in the map using image processing.</p>\r\n\r\n<p>&bull;The teams successful to complete the task will advance to the second round.  </p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Round 2</p>\r\n\r\n<p>The path will be the same as the image provided in round 1. The participants has to make their bot traverse on the path paved by them in round 1.</p>\r\n\r\n<p><u>Pre-Game Setup</u></p>\r\n\r\n<p>The participants will get 20 minutes of setup time for calibration and testing prior to the competition and according to a schedule that will be made available at the start of the event. In the setup time, the participants should have their program ready for execution. During calibration, there can be minor modifications to the code (like fine-tuning filters, etc.) but there can be no changes in the algorithm being used. All changes should be made in the presence of the judges. There can be no more modifications to the code after the calibration.</p>\r\n\r\n<p><u>Competition Setup</u>&nbsp;<br />\r\n<br />\r\n&bull; There would be one overhead camera above the arena perpendicular to the ramp.&nbsp;<br />\r\n&bull; In case of overhead camera, the participants must use the camera provided by the organizers.<br />\r\n&bull; The details of the camera provided by the organizers will be put up soon.</p>\r\n',38,5),(209,'<p>5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Problem Statement</p>\r\n\r\n<p>Build a computer controlled robot which can move on a road with the help of overhead camera.</p>\r\n\r\n<p>Round 1:</p>\r\n\r\n<ul>\r\n	<li>The image for the final track &nbsp;&nbsp;&nbsp;&nbsp;\r\n	<ul>\r\n		<li><img alt=\"\" src=\"http://bits-apogee.org/intro/images/istrike.png\" style=\"height:202px; width:400px\" /></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>Round 2:</p>\r\n\r\n<ul>\r\n	<li>The teams has to make their bot traverse on the path paved by them in round 1 inorder to reach to the finish point.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n',38,7),(210,'<h2 style=\"font-style:italic;\"><span style=\"font-size:16px\">&quot;Humans are what their brains are. The rest of them is a mere appendix.&rdquo; ~Sir Arthur Conan Doyle</span></h2>\r\n\r\n<p><span style=\"font-size:16px\"><big>It&#39;s time we awaken this organ, for what awaits ahead are two hours of some mind-numbing madness. Brain teasers and puzzles, set with an amazing plot in the backdrop, this, for sure is going to leave you aw-struck. Look away for a second, and Lo and Behold, the game elevates to something unimaginable</big></span>.</p>\r\n',9,2),(211,'<p>This event is a platform.</p>\r\n\r\n<p>A platform to realise the significance of all that science we have been fed all these years.</p>\r\n\r\n<p>Instead of Physics, Chemistry , Maths and Biology, this event tests if you know the fundamental roots of your scientific knowledege. It tests how you gel all that knowledge to explain some of the most obvious, daily, routine and sometimes magnificent incidents&nbsp;that occur in nature.&nbsp;</p>\r\n\r\n<p><strong>UNRAVEL</strong> will not only make you realise your inquisitive self, but baffle you with the beauty with&nbsp;which these four schools of Science synergise to formulate the nature around us.</p>\r\n',17,2),(213,'<p>&nbsp; &nbsp; Presence of mind and little bit of Science is all you need.&nbsp;</p>\r\n',17,4),(214,'<p>1. Participants will have to apply simple scientific approaches&nbsp;to solve the questions and puzzles.</p>\r\n\r\n<p>2. Each round will&nbsp;not only test knowledge, but applied logic, and recollection capabilities.</p>\r\n\r\n<p>3. Watching Discovery channel (or alike) may give you an edge.</p>\r\n\r\n<p><strong>4. No Biology is needed.</strong></p>\r\n',17,5),(215,'<p>A bridge is a structure built to span and provide a passage over a physical obstacle. This event will test your skills to approach the problem in an innovative manner. With just scrap, you are expected to build a bridge that can bear maximum load and undergos minimum deflection. You have the freedom on the type of bridge you construct.</p>\r\n',24,2),(216,'<p>Each Team has to make a Bridge using following items&nbsp;satisfying the given specifications.</p>\r\n\r\n<ul>\r\n	<li>Thermocol,</li>\r\n	<li>Cardboard,</li>\r\n	<li>Ice cream sticks,</li>\r\n	<li>Newspaper,</li>\r\n	<li>....</li>\r\n	<li>..</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n',24,7),(217,'<ul>\r\n	<li>Physical Specifications of the bridge are:</li>\r\n</ul>\r\n\r\n<ol style=\"margin-left:40px\">\r\n	<li>Height of deck &ge; 10 centimetres.</li>\r\n	<li>Span of bridge &ge; 40 centimetres</li>\r\n	<li>Pier spacing &ge; 10 centimetres</li>\r\n	<li>Width of deck &ge; 8 centimetres</li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>The bridge should be made keeping in mind the aesthetics, feasibility and most importantly the load it can bear</li>\r\n	<li>Keep in mind that we will only test the weakest point of the bridge. So try to make the bridge with uniform strength throughout its span.</li>\r\n	<li>The bridge must have a level, seamlessly constructed roadway. The deck will be subjected to Concentrated / movable loads along the deck of the bridge</li>\r\n</ul>\r\n',24,10),(218,'<ul>\r\n	<li>All the material required will be provided.</li>\r\n	<li>Teams must be maximum of 4&nbsp;members.</li>\r\n</ul>\r\n',24,3),(219,'<p>!! Open to All&nbsp;!!</p>\r\n',24,4),(220,'<p>Participant must be a full time student enrolled in undergraduate or post graduate programme from&nbsp;any recognized university or college. Any professional body other than student are not allowed in&nbsp;this competition.</p>\r\n',67,4),(221,'<ul>\r\n	<li>Strength of the bridge(i.e.maximum load it can bear.)</li>\r\n	<li>Aesthetic Sense</li>\r\n	<li>Efficiency</li>\r\n</ul>\r\n',24,6),(222,'<p>Registrations can be done on spot&nbsp;also.</p>\r\n',24,12),(223,'<p style=\"text-align: center;\">Proud of&nbsp;your imagination skills?</p>\r\n\r\n<p style=\"text-align: center;\">Want to brag your skills just as in your Engineering Graphic classes??</p>\r\n\r\n<p style=\"text-align: center;\">CEA brings you an AutoCAD based event SRISHTI to flaunt your architectural skills. A fun filled event with various design problems which need your touch of creativity. All you need to do is to take your thinking caps with you and splurge your innovative modifications in the drawings.</p>\r\n\r\n<p style=\"text-align: center;\">LIMITS OFF, SNAP your chance!</p>\r\n\r\n<p style=\"text-align: center;\">EXPLODE &amp; EXTEND your style!!</p>\r\n\r\n<p style=\"text-align: center;\">CHANGE &amp; REDRAW into fictive creation!!!</p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n',25,2),(224,'<p>Ever wanted to feel the power of the driving force of the racing Power boats? Come and build&nbsp;your own Speed boat at Battle of waterloo. Apogee 2016 gives you an opportunity to build your&nbsp;own RC motor boat and prove your mettle against other racers.</p>\r\n',67,2),(225,'<ul>\r\n	<li>Teams of 1-2 are allowed.</li>\r\n	<li>Books are not allowed.</li>\r\n</ul>\r\n',25,3),(226,'<p><strong>1. BOAT Specifications</strong></p>\r\n\r\n<p>1. Maximum dimensions of the BOAT at any point of time during the race</p>\r\n\r\n<p>&bull; Length: 80 cm</p>\r\n\r\n<p>&bull; Breadth: 35 cm</p>\r\n\r\n<p>&bull; There is no constraint on the height.</p>\r\n\r\n<p>(Note: The above mentioned dimensions includes the rudder and propeller of the BOAT)&nbsp;</p>\r\n\r\n<p>2. BOAT can be powered either by an IC engine or a DC electric motor. Use of any other kind of&nbsp;</p>\r\n\r\n<p>power source is strictly prohibited. BOAT must have only one of these power source for propulsion</p>\r\n\r\n<p>3. If powered by an IC engine, the capacity (displacement volume) should not be more than 3.2cc.</p>\r\n\r\n<p>4. If powered by electric motors, the potential difference across the motor terminals should not be&nbsp;</p>\r\n\r\n<p>more than 12volts DC.</p>\r\n\r\n<p>5. In addition to the power sources for propulsion you may use dc motors or servo motors for rudder&nbsp;</p>\r\n\r\n<p>controller.</p>\r\n\r\n<p><strong>2. Fabrication</strong></p>\r\n\r\n<p>? You have to fabricate the hull and rudder mechanism yourself. It is advisable to use light&nbsp;</p>\r\n\r\n<p>weight materials for making the hull (E g. balsa wood, FRP, plastics etc)</p>\r\n\r\n<p>? If any ready-made components are found as a part of the hull, the team will be disqualified.</p>\r\n\r\n<p>? Propeller, rudder fins, remote control, servo motors and electronic circuits can be taken&nbsp;</p>\r\n\r\n<p>directly from other models.</p>\r\n\r\n<p>? Electronic circuits and servo motors/ ic engine should be laminated properly so as to keep&nbsp;</p>\r\n\r\n<p>them off from damage by water.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The BOAT will be inspected by immersing in water before each round and if found unsafe or&nbsp;</p>\r\n\r\n<p>potentially contaminating the water, it will be immediately disqualified from the race.</p>\r\n\r\n<p>&nbsp;</p>\r\n',67,10),(227,'<p><strong>The winner will be chosen based on</strong> <strong>:</strong></p>\r\n\r\n<p>1. Satisfying the boat design requirements.</p>\r\n\r\n<p>2. Performance in Round 1.</p>\r\n\r\n<p>3. Performance in Round 2.</p>\r\n\r\n<p>Time penalties and other intricate details will be described on the spot.</p>\r\n\r\n<p>&nbsp;</p>\r\n',67,6),(228,'<p>There will be multiple rounds ..</p>\r\n\r\n<ul>\r\n	<li>First round will evaluate the candidate&#39;s analytical proficiency through basics of AutoCAD.</li>\r\n	<li>Second round will judge the combination of aptitude, creativity and CAD knowledge of the canditates to solve complex situations.</li>\r\n</ul>\r\n',25,6),(229,'<p style=\"text-align: center;\">There will be a design problem with 5&nbsp;sub-parts which involve basic to advanced operations&nbsp;in AutoCAD based on :</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Imagination</strong>(changing from 3D to 2D),</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Creativity</strong>(innovative designing),</p>\r\n\r\n<p style=\"text-align: center;\"><strong>Precision</strong>&nbsp;&amp; many more.</p>\r\n\r\n<p style=\"text-align: center;\">A 15min. overview of <u><strong>Autodesk AutoCAD 2014</strong></u> will be done prior to the start of the event to brush up your skills.</p>\r\n\r\n<p style=\"text-align: center;\">Additional <strong>bonus&nbsp;questions</strong> will be there to test your basic knowledge of civil engineering.</p>\r\n',25,7),(230,'<p><span style=\"font-size:14px\">The candidates must appear in a team of 2 or 3 and will participate in 7 or 8 round of quizzes for screening. The final 6 teams will be choosen from the participants and will be provided a murder mystery which they must solve by&nbsp;deciphering information provided to them.</span></p>\r\n\r\n<p>Deepanshu Gupta&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tushar Singh</p>\r\n\r\n<p>09782376335&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 08504005914</p>\r\n',23,2),(231,'<p>!! Open to All&nbsp;!!</p>\r\n',25,4),(232,'<p>Registration can be done on spot&nbsp;also..</p>\r\n',25,12),(233,'<div>\r\n<p>The event will be spread over two days, the first day will include around 7 rounds, in each of which the teams would be asked to solve a set of multiple choice type questions to test their logical reasoning in a short frame of time. The bottom teams from each round would be eliminated.</p>\r\n\r\n<p>The teams still standing at the end of all the rounds will move on to day two.</p>\r\n\r\n<p>On day two, the teams will be given a crime scene and various clues, evidences and characters related to the crime will be presented to them. The teams will have to then solve the crime by piecing together all the information. Teams may even be expected to perform some simple laboratory experiments for which they would receive guidance from the organizers.</p>\r\n\r\n<p>The team that does so the fastest and satisfactory answer with all the proper reasoning, wins.&nbsp; &nbsp;</p>\r\n</div>\r\n',23,3),(234,'<p><span style=\"font-size:14px\">All students can participate in the event.</span></p>\r\n',23,4),(235,'<div>\r\n<p><strong>Round 1:</strong>&nbsp; Teams that finish the most number of questions assigned to them correctly within the stipulated time stay alive.</p>\r\n\r\n<p><strong>Round 2:</strong> The team that correctly solves the entire crime first with satisfactory answer with proper reasoning , wins.</p>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n',23,6),(237,'<p>Build a wireless remote controlled BOAT which travels a specified race track in the least possible&nbsp;</p>\r\n\r\n<p>time.</p>\r\n',67,7),(238,'<p><strong>ROUND 1</strong></p>\r\n\r\n<p>1. Best of two trials will be considered (least time taken to reach the finish line) for the teams&nbsp;</p>\r\n\r\n<p>to qualify for the second round.</p>\r\n\r\n<p>2. The track will be free from obstacles.</p>\r\n\r\n<p>3. The exact number of teams qualifying for the second round will be decided based on the&nbsp;</p>\r\n\r\n<p>number of participants.&nbsp;</p>\r\n\r\n<p>4. If Participants are using an IC engine, they can start the engine and the BOAT will be placed&nbsp;</p>\r\n\r\n<p>in the water and released it when the signal is given.</p>\r\n\r\n<p>5. There will be penalty for touching the boundary.</p>\r\n\r\n<p><strong>ROUND 2</strong></p>\r\n\r\n<p>1. Teams qualifying round 1 will participate in this round.</p>\r\n\r\n<p>2. Round 2 is meant to test the speed, steering skills of the boat through various obstacles on&nbsp;</p>\r\n\r\n<p>the track. Details of the track will be uploaded later.</p>\r\n',67,3),(239,'<p>The competition is open to all BITSians and all outstation participants.</p>\r\n',59,4),(240,'<p>Participants are invited to come up with an innovative design for low cost and efficient cycle design.</p>\r\n\r\n<p>The problem statement needs following points to be tackled:</p>\r\n\r\n<ul>\r\n	<li>Modularity</li>\r\n	<li>Dynamics</li>\r\n	<li>Anti-theft</li>\r\n	<li>Lightweight</li>\r\n	<li>Safety and comfort</li>\r\n</ul>\r\n\r\n<p>Extra points will be given for any other innovation incorporated in the design.</p>\r\n',59,7),(241,'<p><span style=\"font-size:14px\">All chemicals and other necessary resources will be supplied by the Chemistry Department.</span></p>\r\n',23,8),(243,'<p>There Will be On Spot Registrations.</p>\r\n',22,12),(244,'<p><span style=\"font-size:14px\">There Will be Online as well as On Spot Registration.</span></p>\r\n',23,12),(246,'<p>The Internet of Things (IoT) is an environment in which objects, animals or people are provided with unique identifiers and the ability to transfer data over a network without requiring human-to-human or human-to-computer interaction.&nbsp;IoT has touched and changed human lives in myriad ways and will get bigger in the future, making machines smart extensions of humans.</p>\r\n\r\n<p>Get a chance to be a part of this revolution with IoT Challenge!</p>\r\n\r\n<p>IoT Challenge gives you an opportunity to realize your IoT dreams where the tools are provided by the Masters - <strong>Texas Instruments</strong>.&nbsp;</p>\r\n\r\n<p>The beauty of this challenge is that there will be no particular problem statement, which means no limits to your imagination!&nbsp;You can ideate an IoT solution in any of the facets of human life to make it simpler, easier, or more organized.&nbsp;</p>\r\n',80,2),(249,'<ol>\r\n	<li>Participants have to form teams of 2-4.</li>\r\n	<li>In the preliminary round, teams will have to register by submitting their solution in a detailed written form on the online portal by <strong>26<sup>th</sup>&nbsp;Jan</strong>.</li>\r\n	<li>The teams with innovative and feasible solutions will be selected for the final round. Results of the preliminary round will be announced online.</li>\r\n	<li>The selected teams will be provided a tool kit by&nbsp;TI containing all the necessary equipments to build an IoT working prototype till <strong>2<sup>nd</sup> Feb.</strong></li>\r\n	<li>Use of non-TI processors will lead to disqualification.</li>\r\n	<li>The teams will present their working prototype at <strong>APOGEE-2016</strong>&nbsp;before a panel of expert judges.</li>\r\n	<li>Each member of the winning team will get TI&#39;s smartwatch. Apart from this, all the teams presenting their solution in the final round will get certificates from TI.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n',80,3),(250,'<ul>\r\n	<li>Registration Rules:\r\n	<ul>\r\n		<li>A team may consist of maximum 4 members.</li>\r\n		<li>Students from different educational institutions may form a team.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Event Rules:\r\n	<ul>\r\n		<li><strong>Round 1 (extended to 12th Feb, 2016)</strong>: Teams will be required to send us an abstract* which should have the various innovative ideas for the SMART-CYCLE.</li>\r\n		<li><strong>Round 2 (21st Feb, 2016)</strong>:&nbsp;The selected teams will be required to send us the Sketch/CAD of their design along with a paper in the prescribed format.</li>\r\n		<li><strong>Round 3 (During APOGEE)</strong>:&nbsp;The Final teams will present their Design in the form of Powerpoint presentation during Apogee 2016.</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>*<strong>The Abstract should include a short write-up of around 350-450 words and Keywords. Also, include the details of team members.</strong></p>\r\n\r\n<p>**<strong>The Abstract, Paper and the Design CAD/Sketch should be mailed to us at </strong><strong><a href=\"mailto:manu-assoc@bits-apogee.org?subject=INNOVER_APOGEE2016\">manu-assoc@bits-apogee.org</a></strong><strong> on/before the last day of submission. </strong></p>',59,3),(251,'<p>We are honoured to have <u>Texas Instruments</u> as the event&nbsp;sponsor of IoT Challenge 2016.</p>\r\n\r\n<p>Texas Instruments, a global semiconductor company operating in 35 countries, have over 30,000 employees who design, manufacture and sell analog and embedded processing chips with an aim to change the world through technology.&nbsp;At TI, they redefine what&#39;s possible and improve people&#39;s lives with their technologies that make cities smarter, cars safer, factories more automated and bring life-connected wearable products to&nbsp;make us healthier.</p>\r\n\r\n<p>Analysts estimate that over 50 billion devices will be connected to the Internet by 2020. In this exploding Internet of Things, users, things and cloud services connect using the Internet to enable new cases&nbsp;and models. TI is the only semiconductor company with all of the building blocks to enable the IoT. TI makes developing applications easier with hardware, software, and support to get anything connected within the IoT.</p>\r\n',80,14),(252,'<ul>\r\n	<li>Can teams be formed from different colleges or different years? &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp;</li>\r\n</ul>\r\n\r\n<p style=\"margin-left:40px\">Yes.</p>\r\n\r\n<ul>\r\n	<li>Is registration to be done&nbsp;before abstract submission?&nbsp;</li>\r\n</ul>\r\n\r\n<p style=\"margin-left:40px\">No. Registration will be done along with abstract submission.</p>\r\n\r\n<ul>\r\n	<li>In what form is the abstract to be submitted?</li>\r\n</ul>\r\n\r\n<p style=\"margin-left:40px\">The abstract should contain a detailed description on reason of choosing the idea, the need of the device and a step by step execution plan for making the device. It should be a pdf&nbsp;file to be submitted on the online portal.</p>\r\n\r\n<ul>\r\n	<li>How will the outstation students receive the tool kits?&nbsp;</li>\r\n</ul>\r\n\r\n<p style=\"margin-left:40px\">The tool kits will be shipped to their respective places by the given date.</p>\r\n\r\n<ul>\r\n	<li>Can tools outside the tool kit be used for making the prototype?&nbsp;</li>\r\n</ul>\r\n\r\n<p style=\"margin-left:40px\">The tool kit will contain a Launchpad. The Energia IDE software of TI can be downloaded freely from the website - www.energia.nu. Participants can order sensors&nbsp;and other related ICs free of cost from the TI e-store.(They will have to place the order using their college email address). Apart from this, use of non-TI processors will lead to disqualification.</p>\r\n\r\n<ul>\r\n	<li>What will be the criteria for judgement?</li>\r\n</ul>\r\n\r\n<p style=\"margin-left:40px\">For the preliminary&nbsp;round, solutions will be checked based on feasibility, uniqueness and scope of the idea. For the final round, solutions will be judged on the basis of implementation of the proposed plan and innovative use of tools.</p>\r\n',80,13),(253,'<p>1.The time taken for the bot to come back from the centre of the track to the starting&nbsp;point&nbsp;will be considered. In case of non completion, the distance covered by the bot will be considered for scoring.&nbsp;</p>\r\n\r\n<p>2. The decision of the judges shall be final and binding.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\nFor queries contact :</p>\r\n\r\n<p>PRATIK JAIN</p>\r\n\r\n<p>+91-8385099740</p>\r\n\r\n<p>PINAKIN PADALIA</p>\r\n\r\n<p>+91-8504059240</p>\r\n',37,6),(256,'<p>Round 1 &amp; 2 : The track will be a white line on a black background. The line will be of 2 cm thickness, with slight variations not exceeding 5% error.</p>\r\n\r\n<p>Round 2 : The track is made of 4 concentric squares.&nbsp;The largest side is of 300 cm and each subsequent one being 16 cm smaller&nbsp;than the previous . All 4 of them are aligned radially with equal spacing. Two consecutive squares are connected by a connecting bridge joining the mid of the corresponding edges. The innermost square&nbsp;will have one pair of opposite&nbsp;midpoints connected by a bridge. There will be no dead ends in the track.</p>\r\n\r\n<p>&nbsp;</p>\r\n',37,10),(257,'<p>1. Any undergraduate student of any discipline is eligible to participate in this event.</p>\r\n\r\n<p>2. Each team may have a maximum of four members.</p>\r\n\r\n<p>3. No individual may be part of more than one team.</p>\r\n\r\n<p>&nbsp;</p>\r\n',37,4),(258,'<p>Is your bot under control ? Get to the centre of this psycadelic stator . Thats not all ! Now follow the <strong>SHORTEST</strong>&nbsp;path and bring your bot to where it started.&nbsp;</p>\r\n',37,2),(259,'<p><strong>Case Problem</strong></p>\r\n\r\n<p>Trista PLC are a Korean company who produce high technology goods such as CD players. Recently they opened a factory in the town of Rockton in Thales, Blueberry - an economic development area. The factory is doing well with 70% of its sales coming from the British market. However relations with the local population are poor.</p>\r\n\r\n<p>The anticipated benefits to the town from the building of the factory haven&#39;t materialized, as most of the workforce needed to be highly skilled and were brought in from other areas, thus providing little local employment. These non-locals were highly paid and have pushed up prices in the local shops and also house prices leading to resentment.</p>\r\n\r\n<p>The chairman is aware of this resentment and wants to improve the situation. The directors have agreed that up to &pound;300,000 may be spent on a scheme to benefit the community and lift the company&#39;s image in the community.</p>\r\n\r\n<p><strong>Three possible schemes have been put forward:</strong></p>\r\n\r\n<p><strong>Scheme 1:</strong></p>\r\n\r\n<p>The local hospital wants to set up a new heart disease unit. A donation of &pound;300,000 would make this possible.</p>\r\n\r\n<p><strong>Scheme 2:</strong></p>\r\n\r\n<p>The Mar stairs Arts Centre is a charity that runs a prestigious orchestra for young people as one of its activities. The orchestra has been invited to tour Northern France next summer. The company could enter into a deed of covenant to pay the Arts Centre &pound;100,000 for the next four years.</p>\r\n\r\n<p><strong>Scheme 3:</strong></p>\r\n\r\n<p>The local football club Mar stairs United are a Championship Division club sometimes seen on TV. &pound;250,000 would advertise the company in the ground and on the team&#39;s playing strips for two years</p>\r\n\r\n<p><strong>The views of the Chairman and Directors are as follows:</strong></p>\r\n\r\n<p><strong>The Finance Director</strong></p>\r\n\r\n<p>The Finance Director&#39;s Calculations:</p>\r\n\r\n<p>Scheme 1. No tax savings would accrue.</p>\r\n\r\n<p>Scheme 2. Tax savings from this would be &pound;25,000 p.a.</p>\r\n\r\n<p>Scheme 3. A tax saving of &pound;100,000 would accrue from this.</p>\r\n\r\n<p><strong>The Marketing Director feels:</strong></p>\r\n\r\n<p>Scheme 1 would scarcely increase sales at all. The unit would be small but the publicity would be very positive.</p>\r\n\r\n<p>Scheme 2 would give a moderate increase to sales in France. The company is shortly to launch a marketing operation in France and though there would be no advertising, the company&#39;s involvement would be publicized.</p>\r\n\r\n<p>Scheme 3 would have a major impact on sales. Some problems are that cricket is as popular as football in Kent and hooliganism has been a problem at the club.</p>\r\n\r\n<p><strong>The Chairman</strong></p>\r\n\r\n<p>The Chairman has said that he would like to see other benefits to the company as well as the public relations boost.</p>\r\n\r\n<p><em>The Chairman has asked you, as a promising young manager, to study the three proposals and make a recommendation on which of the schemes the company should support and why for consideration by the Board of Directors at its next meeting. Only one of the schemes can be supported. After examining all the information say which scheme the company should support and give your reasons.</em></p>\r\n',35,7),(260,'<p>A robot may not injure a human being or, through inaction, allow a human being to come to harm. A robot must obey any orders given to it by human beings, except where such orders would conflict with the First Law. A robot must protect its own existence as long as such protection does not conflict with the First or Second Law.1942: Asimov formulates the Laws of Robotics. Apogee 2016 redefines the third-A robot must protect its own existence; to hell with everything else.</p>\r\n',39,2),(261,'<p>Team Specifications: &nbsp;A team may consist of at most 4 members. Inter - college teams may be formed. Bot Specifications</p>\r\n\r\n<p><span style=\"line-height:1.6\">Rules</span></p>\r\n\r\n<ul>\r\n	<li>In no case should the Arena be damaged by any Bot.</li>\r\n	<li>Compliance with all event rules is mandatory. It is expected that competitors stay within he rules and procedures of their own accord and do not require constant policing.</li>\r\n	<li>Special care should be taken to protect the on-board batteries and pneumatics, robot without proper protection will not be allowed to compete.</li>\r\n	<li>If you have a robot or weapon design that does not fit within the categories set forth n these rules or is in some way ambiguous or borderline, please contact the event organizers. Safe innovation is always encouraged, but surprising the event staff with your brilliant exploitation of a loophole may cause your robot to be disqualified before it even competes.</li>\r\n	<li>Each event has safety inspections. It is at their sole discretion that your robot is allowed to compete. As a builder you are obligated to disclose all operating principles and potential dangers to the inspection staff.</li>\r\n	<li>Proper activation and deactivation of robots is critical. Robots must only be activated in the arena, testing areas, or with expressed consent of the event coordinators.</li>\r\n	<li>All weapons must have a safety cover on any sharp edges.</li>\r\n	<li>All participants build and operate robots at their own risk. Combat robotics is inherently dangerous. There is no amount of regulation that can encompass all the dangers involved.</li>\r\n	<li>Please take care to not hurt yourself or others when building, testing and competing.</li>\r\n</ul>\r\n',39,3),(262,'<p>1) Dimensions and Fabrications</p>\r\n\r\n<ul>\r\n	<li>The machine should fit in a box of dimension 750 mm x 750 mm x 1000 mm (lxbxh) at any given point during the match. The external device used to control the machine or any external tank is not included in the size constraint.</li>\r\n	<li>The machine should not exceed 40 kg of weight including the weight of pneumatic source/tank. If the tank is external, its weight would be considered 1.5 times its actual weight. Weight of wireless robots and robots having on-board power supply will be counted as 0.6*Actual Weight. Weight of adaptors and the remote controller will not be counted.</li>\r\n	<li>The electric voltage between any two points on the robot should not exceed 36V at any time.</li>\r\n	<li>The machine can be controlled using a wired or wireless device throughout the fight. In case of wireless control, the robot must be installed with a dual frequency radio to prevent interference with the opponent&rsquo;s robot. In case of any interference in the wireless systems, no possibility of rematch exists.</li>\r\n	<li>Readily available remote controlled systems with dual frequency from the markets may be used.</li>\r\n	<li>Before the event, each robot will be inspected by the judges and if the robot is declared as dangerous either to the spectators or the course of the event, it may be disqualified on the spot.</li>\r\n</ul>\r\n\r\n<p>2) Battery and Power</p>\r\n\r\n<ul>\r\n	<li>The machine can be powered electrically only. Use of an IC engine in any form is not allowed. On board Batteries must be sealed, immobilized-electrolyte types (such as gel cells, lithium, NiCad, NiMH, or dry cells).</li>\r\n	<li>The electric voltage between 2 points anywhere in the machine should not be more than 36 V DC at any point of time. If a team is using AC voltage in any of its parts then the voltage should not exceed 36 V AC at any point of time as well.</li>\r\n	<li>All efforts must be made to protect battery terminals from a direct short and causing a battery fire, failure to do so will cause direct disqualification.</li>\r\n	<li>Use of damaged, non-leak-proof batteries may lead to disqualification.</li>\r\n	<li>Battery Eliminators are allowed and power source would be available at the venue for the Eliminator.</li>\r\n	<li>Special care should be taken to protect the on-board batteries.</li>\r\n	<li>Change of battery will not be allowed during the match. Judge&rsquo;s decision will be final in this case.</li>\r\n</ul>\r\n\r\n<p>3) Pneumatics</p>\r\n\r\n<ul>\r\n	<li>Robot can use pressurized non-inflammable gases to actuate pneumatic devices. Maximum allowed outlet nozzle pressure is 8 bar. The storage tank and pressure regulators used by teams need to be certified and teams using pneumatics are required to produce the Safety and Security letters at the registration Desk at the venue. Failing to do so will lead to direct disqualification.</li>\r\n	<li>Participants must be able to indicate the used pressure with integrated or temporarily fitted pressure gauge. Also there should be provision to check the cylinder pressure on the bot.</li>\r\n	<li>The maximum pressure in cylinder should not exceed the rated pressure at any point of time.</li>\r\n	<li>You must have a safe way of refilling the system and determining the on board pressure.All pneumatic components on board a robot must be securely mounted. Care must be taken while mounting the pressure vessel and armour to ensure that if ruptured it will not escape the robot. The terms &#39;pressure vessel, bottle, and source tank&#39; are used interchangeably.</li>\r\n</ul>\r\n\r\n<p>4) Hydraulics</p>\r\n\r\n<ul>\r\n	<li>Robot can use non-inflammable liquid to actuate hydraulic devices e.g. cylinders.</li>\r\n	<li>All hydraulic components on-board a robot must be securely mounted. Special care must be taken while mounting pump, accumulator and armour to ensure that if ruptured direct fluid streams will not escape the robot.</li>\r\n	<li>All hydraulic liquids are required to be non-corrosive and your device should be leak proof. Maximum allowed pressure is 8 bars.Participant must be able to indicate the used pressure with integrated or temporarily fitted pressure gauge.</li>\r\n</ul>\r\n\r\n<p>5) Weapons Systems</p>\r\n\r\n<ul>\r\n	<li>Robots can have any kind of magnetic weapons, cutters, flippers, saws, lifting devices, spinning hammers etc. as weapons with following exceptions and limitations:</li>\r\n	<li>Liquid projectiles</li>\r\n	<li>Any kind of inflammable liquid</li>\r\n	<li>Flame-based weapons</li>\r\n	<li>Any kind of explosive or intentionally ignited solid or potentially ignitable solid</li>\r\n	<li>Nets, tape, glue, or any other entanglement device</li>\r\n	<li>High power magnets or electromagnets</li>\r\n	<li>Radio jamming, tazers, tesla coils, or any other high-voltage devices.</li>\r\n	<li>Tethered or un-tethered projectiles</li>\r\n	<li>Spinning weapons which do not come in contact with the arena at any point of time are allowed</li>\r\n</ul>\r\n',39,10),(263,'<p>Q1. Can the fighting parts of the robot be outside the given bot size specifications?</p>\r\n\r\n<p>Ans- No, the robot should follow the size specifications as given in the rules.</p>\r\n\r\n<p>Q2. Can the weight of the robot be a bit more than specified?</p>\r\n\r\n<p>Ans- No.</p>\r\n\r\n<p>Q3. If my robot gets immobilized for some time but works after the judgement, would there be a rematch?</p>\r\n\r\n<p>Ans- The decision of the judges would be final at the time of the event. In this case, the bot would not be allowed for a rematch.</p>\r\n',39,13),(264,'<p>Design a remote controlled robot to combat with the opponent&#39;s bot.The arena will be rectangularin shape measuring 24ft x 24ft however the fight zone will be 20ft x 20ft. Pushing the opponent bot out of this fight zone will result in victory. The arena might be on hard and uneven ground and will be enclosed by a 5ft high wire meshes all around.</p>\r\n',39,7),(265,'<p>http://www.loganbot.com/bot_tips.html</p>\r\n\r\n<p>http://secretweapon.netfirms.com/howto/howto.htm</p>\r\n\r\n<p>http://www.solarnavigator.net/robotbuildingtips.htm (Read the section on Combat Bot Failures).</p>\r\n\r\n<p>http://www.robotcombat.com/tips.html</p>\r\n',39,8),(266,'<p>A robot is declared victorious if its opponent is immobilized. A robot will be declared immobile if it cannot display linear motion of at least one inch in a timed period of 30 seconds. A bot with one side of its drive train disabled will not be counted out if it can demonstrate some degree of controlled movement.In case both the robots remain mobile after the end of the round then the winner will be decided subjectively.A robot that is deemed unsafe by the judges after the match has begun will be disqualified and therefore, declared the loser. The match will be immediately halted and the opponent will be awarded a win. Points will be given on the basis of aggression, damage, control and strategy:</p>\r\n\r\n<ul>\r\n	<li>Aggression &ndash; Aggression is judged by the frequency, severity, boldness and effectiveness of attacks deliberately initiated by the robot against its opponent. If a robot appears to have accidentally attacked an opponent, that act will not be considered Aggression.</li>\r\n	<li>Control &ndash; Control means a robot is able to attack an opponent at its weakest point, use its weapons in the most effective way, avoid Arena Hazards, and minimize the damage caused by the opponent or its weapons.</li>\r\n	<li>Damage &ndash; Through deliberate action, a robot either directly, or indirectly using the Arena Hazards, reduces the functionality, effectiveness or defensibility of an opponent. Damage is not considered relevant if a robot inadvertently harms itself. Also, if a pressure vessel or a rapidly spinning device on a robot fragments, any damage to the opponent will not be considered &quot;deliberate&quot;.</li>\r\n	<li>Strategy &ndash; The robot exhibits a combat plan that exploits the robot&#39;s strengths against the weaknesses of its opponent. Strategy is also defined as a robot exhibiting a deliberate defence plan that guards its weaknesses against the strengths of the opponent. Strategy can also involve using the Arena Hazards (if any) to gain an advantage.</li>\r\n</ul>\r\n',39,6),(267,'<p style=\"margin-left:18pt\">Steps for registering for the online round&nbsp;:</p>\r\n\r\n<ul>\r\n	<li>Visit DSIJ website&nbsp;www.dsij.in</li>\r\n	<li>Log in to Stock Market Challenge Game.</li>\r\n	<li>Click on Settings link.</li>\r\n	<li>Under join contest select contest&nbsp;<strong>&quot;Stock Market Simulation&quot; and use&nbsp;Contest Key: ujdKD6X2.</strong></li>\r\n	<li>Click on join contest.</li>\r\n</ul>\r\n\r\n<p><strong>Note: Participants who&#39;re already registered on the DSIJ website need to make fresh registrations to play the contest.</strong></p>\r\n',36,12),(268,'<p>Information is all around us, existing&nbsp;in secret messages. But who said a secret message can&#39;t be broken?</p>\r\n\r\n<p><strong>CICADA 333031</strong>&nbsp;will be a race against time to break the acquire&nbsp;the secret and&nbsp;discover the&nbsp;hidden message.</p>\r\n\r\n<p><u>For starters</u>, try to&nbsp;&#39;see&#39; the what&#39;s&nbsp;written in &#39;blocks-and-bars&#39;, given&nbsp;in the link:&nbsp;http://bits-apogee.org/2016/static/registrations/portal/assets/img/ap_logo.png</p>\r\n',18,2),(269,'<p><span style=\"color:#000000\"><span style=\"font-size:14px\"><strong>The general rules of this event are as follows:</strong></span></span></p>\r\n\r\n<p><span style=\"color:#000000\"><span style=\"font-size:14px\"><strong>1)&nbsp;There will be an elimination round at the start that will test your basic journalist skills.&nbsp;<br />\r\n2) Then a limited number of teams will be selected.&nbsp;<br />\r\n3) After a few rounds there will be a wild card entry from the audience based on a written questionnaire.&nbsp;<br />\r\n4) Final rounds will test the analytical skills, wit, judgment, promptness and perspective of the participating teams.&nbsp;<br />\r\n5) Team Size: 2&nbsp;members</strong></span></span></p>\r\n',5,3),(270,'<ul>\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\">All Bitsians are eligible with no pre-requisites.</span></span></li>\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\">Participants of any college other than BITS Pilani should be registered for APOGEE-2016.</span></span></li>\r\n</ul>\r\n',5,4),(271,'<p>- Different rounds will have different criterias. On one side there will be some straight point based rounds whereas on the other side some rounds will test your creativity, humour and innovative skills on stage.</p>\r\n',5,6),(272,'<p><span style=\"color:#000000\"><span style=\"font-size:14px\"><strong>JOURNALISM !!! &nbsp; &nbsp;NEWS !!! &nbsp; &nbsp;MEDIA !!!</strong></span></span></p>\r\n\r\n<p><span style=\"color:#000000\"><span style=\"font-size:14px\"><strong>Do these words generate a spark within you?</strong></span></span></p>\r\n\r\n<p><span style=\"color:#000000\"><span style=\"font-size:14px\"><strong>Are you passionate enough to test your skills in the world of Journalism?</strong></span></span></p>\r\n\r\n<p><span style=\"color:#000000\"><span style=\"font-size:14px\"><strong>Do you want to be the next &#39;M.J.Akbar&#39; or the next &#39;Barkha Dutt&#39;?</strong></span></span></p>\r\n\r\n<p><span style=\"color:#000000\"><span style=\"font-size:14px\"><strong>This event basically aims at bringing out the hidden journalist inside you. Participants will be tested on their &#39;<em>Awareness</em>&#39;, &#39;<em>Reporting skills</em>&#39;, &#39;<em>Communication skills</em>&#39; and whatever one can imagine of, by the word &quot;MEDIA&quot;. Specific details and rules of the various rounds of this event will be declared on the spot to retain the surprise element.</strong></span></span></p>\r\n\r\n<p><span style=\"color:#000000\"><span style=\"font-size:14px\"><strong>If you are a maniac for media, then MEDIA MANIA is just the right event for you!!!</strong></span></span></p>\r\n\r\n<p><span style=\"color:#000000\"><span style=\"font-size:14px\"><strong>On spot registrations!!</strong></span></span></p>\r\n\r\n<p><span style=\"color:#000000\"><span style=\"font-size:14px\"><strong>For further details contact :</strong></span></span></p>\r\n\r\n<p><span style=\"color:#000000\"><span style=\"font-size:14px\"><strong>Suyash Kirti Sharma</strong></span></span></p>\r\n\r\n<p><span style=\"color:#000000\"><span style=\"font-size:14px\"><strong>9928099132</strong></span></span></p>\r\n',5,2),(273,'<p><span style=\"color:#000000\"><span style=\"font-size:14px\">One of the most common sights of the beginning of a day (apart from that of an alarm on your phone that you put on snooze&nbsp;the millionth time) is that of the newspaper for most of us&nbsp;and to be precise- &#39;the cover page!&#39; But did you ever think of what goes behind those fascinating pages?</span></span></p>\r\n\r\n<p><span style=\"color:#000000\"><span style=\"font-size:14px\">Ever thought of being the creator and not just the reader?</span></span></p>\r\n\r\n<p><span style=\"color:#000000\"><span style=\"font-size:14px\">Here is your chance!</span></span></p>\r\n\r\n<p><span style=\"color:#000000\"><span style=\"font-size:14px\">We provide you with the news and the content and you need to have &#39;it&#39; in you to put them together in the most zingy and catchy way possible and come up with an eye catching front page! <em>Seems pretty easy? You bet!</em></span></span></p>\r\n\r\n<p><span style=\"color:#000000\"><span style=\"font-size:14px\">Come and try your skills in this exciting event for media enthusiasts; and even for those not, to turn into one!</span></span></p>\r\n',6,2),(274,'<p><span style=\"color:#000000\"><span style=\"font-size:14px\">Rules and some General Advices:</span></span></p>\r\n\r\n<ul>\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\">Team size: Maximum&nbsp;<em>5</em>&nbsp;members</span></span></li>\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\">Page size should be standard&nbsp;<em>A3.</em></span></span></li>\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\">Language can be both&nbsp;<em>English and Hindi</em>; Hindi would be awarded preference in case of a tie.</span></span></li>\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\">Use of softwares like &#39;MS Publisher&#39;, &#39;Paint&#39;, &#39;Photoshop&#39;, etc. is advised.</span></span></li>\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\">Participants would be provided with around 10-15 headlines, containing news items from all fields (viz. politics, sports, entertainment, business, etc.). One can choose any number of the given news and come up with a front page that catches all the eye-balls.</span></span></li>\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\">Participants need not include the whole article in their entries. The news can be modified in terms of language, content length, headline and they can also add an apt photograph, if at all they wish to.</span></span></li>\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\"><em>Cartoons, polls, advertisements, etc are entirely entitled to the choice of the participants</em>. However, the advertisements are constrained to cover not more than one-sixth of the page. (In case of a tie, the one with lesser advertisements would be preferred).</span></span></li>\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\">Along with the designed page the participants need to submit a write-up containing the following details:</span></span></li>\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\">Team name</span></span></li>\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\">Team members&#39; name</span></span></li>\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\">College&#39;s name</span></span></li>\r\n	<li><span style=\"color:#000000\"><span style=\"font-size:14px\">Any one Email Id</span></span></li>\r\n</ul>\r\n\r\n<p><span style=\"color:#000000\"><span style=\"font-size:14px\">For any further queries regarding the event, feel free to call:</span></span></p>\r\n\r\n<p><span style=\"color:#000000\"><span style=\"font-size:14px\">Suyash</span></span></p>\r\n\r\n<p><span style=\"color:#000000\"><span style=\"font-size:14px\">9928099132</span></span></p>\r\n',6,3),(275,'<p><span style=\"color:#000000\"><span style=\"font-size:14px\">All Bitsians are eligible without any pre-requisites.</span></span></p>\r\n\r\n<p><span style=\"color:#000000\"><span style=\"font-size:14px\">Participants from other colleges should be registered for Apogee 2016</span></span></p>\r\n',6,4),(276,'<p><span style=\"color:#000000\"><span style=\"font-size:14px\">Have you&hellip;</span></span></p>\r\n\r\n<p><span style=\"color:#000000\"><span style=\"font-size:14px\">Ever been fascinated by the art of News Reporting on TV?</span></span></p>\r\n\r\n<p><span style=\"color:#000000\"><span style=\"font-size:14px\">Ever acted as a TV Reporter for fun?</span></span></p>\r\n\r\n<p><span style=\"color:#000000\"><span style=\"font-size:14px\">Ever thought you could be getting prizes for the same?</span></span></p>\r\n\r\n<p><span style=\"color:#000000\"><span style=\"font-size:14px\">Well, iReport is your chance to do the same! All you have to do is show your creativity &amp; sense of humour and get cracking with short video clips in which any event is being reported. Apart from a video camera, this event requires innovation on your part and you get to put forward the best funny ideas you got. Gear up with your wingies, Make it a wing showdown and show us how crazy a reporting video your wing can make.</span></span></p>\r\n\r\n<p><span style=\"color:#000000\"><span style=\"font-size:14px\">So.... Lights! Camera!! Report!!!</span></span></p>\r\n',7,2),(277,'<p><span style=\"color:#000000\"><span style=\"font-size:14px\"><strong>- All Bitsians are eligible for the event with no prerequisites.</strong></span></span></p>\r\n\r\n<p><span style=\"color:#000000\"><span style=\"font-size:14px\"><strong>- Participants from other colleges must be registered for Apogee-2016.</strong></span></span></p>\r\n',7,4),(278,'<p>&quot;<em>With great power comes great responsibility</em>&quot;.</p>\r\n\r\n<p>So, This year we give you the power to design a <strong>SMART-CYCLE</strong> incorporating all the innovations you can think of and also, you are responsible for it&#39;s marketing, i.e. you will be required to design it&#39;s marketing strategy for the AAM-JANTA.</p>\r\n\r\n<p color=\"white\"><b><a href=\"https://drive.google.com/open?id=0ByP2y6vJCt4wNEpjeVNPT0FPVEE\">INNOVER DOCUMENTATION</a></b></p>\r\n<p color=\"white\"><b><a href=\"https://drive.google.com/open?id=0ByP2y6vJCt4wYTdxRGYtLTdwMFE\">PAPER FORMAT</a></b></p>\r\n\r\n<p>Shubham Rathi +91-7728095485</p>\r\n\r\n<p>Rohan Jangid +91-9950022672</p>\r\n\r\n<p>Himanshu Sharma +91-8504005747</p>',59,2),(279,'<p><br />\r\n<em>Round 1</em>: The <strong>abstract</strong> will be evaluated on the basis of the points mentioned in the problem statement.</p>\r\n\r\n<p><em>Round 2</em>: The <strong>Sketch/CAD</strong> along with the <strong>paper</strong> will be judged by our expert.</p>\r\n\r\n<p><em>Round 3</em>: Final <strong>Powerpoint Presentation</strong> during apogee.</p>\r\n\r\n<p><em>*All the rounds will be judged by our Product Design and Development expert.</em></p>\r\n',59,6),(280,'<ol>\r\n	<li>This event consists of two rounds. Based on the scores obtained in first round, teams will qualify for second round.</li>\r\n	<li>Each team may have a maximum of two members.</li>\r\n	<li>No individual may be part of more than one team.</li>\r\n	<li>No internet access or books are allowed.</li>\r\n	<li>In case of any disputes/discrepancies, the organisers&#39; decision will be final and binding.&nbsp;</li>\r\n</ol>\r\n',58,3),(281,'<p>Any undergraduate student of any discipline is eligible to participate in this event.<br />\r\n&nbsp;</p>\r\n',58,4),(282,'<ul>\r\n	<li><strong>Round 1 &nbsp;</strong>A subjective paper having digital design conceptual questions.</li>\r\n	<li><strong>Round 2 &nbsp;</strong>At the beginning of round 2, a problem statement is given to the qualified teams along with a list of available ICs. This round consists of two stages :\r\n	<ul>\r\n		<li>The teams are expected to provide an on-paper solution to the problem statement, that uses only the ICs given in the list.</li>\r\n		<li>After a brief inspection of the mentioned solution, components are given to the teams and they are expected to implement the solution.</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n',58,7),(283,'<p>Based on the scores obtained in first round, teams will qualify for second round. The team obtaining maximum score in second round will be declared as winner.&nbsp;</p>\r\n\r\n<p><br />\r\nThe decision of the organisers&nbsp;will be final and binding.<br />\r\n&nbsp;</p>\r\n',58,6),(284,'<p>On-spot registration.</p>\r\n',58,12),(288,'<p>Relay Dumb Charades is a fun filled event with many twists and turns.</p>\r\n',46,2),(289,'<p>General rules of Dumb Charades</p>\r\n',46,3),(290,'<p>This is indeed India! the land&nbsp;of fabulous <strong>Innovations</strong> and <strong>Entrepeneurs</strong>,&nbsp;of epic <strong>Ancient Science</strong>, of <strong>Enlightened&nbsp;Minds</strong>,&nbsp;mother of <strong>History</strong>,&nbsp;the country of a hundred nations and a hundred tongues,&nbsp;whose yesterdays bear date with the mouldering antiquities of the rest of the nations.<br />\r\nA quiz about our own country. Come and see how much you actually know about her.</p>\r\n',70,2),(291,'<ul>\r\n	<li>This is a team event. Each team will have a maximum of 3 members.</li>\r\n	<li>Bring a Pen along.</li>\r\n	<li>The event will take place in two rounds, prelims followed by the finals.</li>\r\n	<li>Approximately 10&nbsp;teams from the prelims will qualify for the finals.</li>\r\n	<li>In the finals, the quiz master will explain detailed rules before conducting every round.</li>\r\n</ul>\r\n',70,3),(292,'<p>OnSpot and online registrations</p>\r\n',51,12),(293,'<p>All the designing and simulation will be done on a simulation software &ldquo;CISCO Packet Tracer&rdquo; .</p>\r\n\r\n<p>The simulation software can be preinstalled by the participant on his own laptop or can we can provideit. All the resources to learn the software and run simulation will be provided by us.Also, a lecture or workshop will be conducted pre-apogee to impart the knowledge of networking and&nbsp;software to the students of BITS Pilani. The lecture/workshop might include the basics of networking&nbsp;and some basic tutorials of the simulation software. All the resources and links to learn the same will&nbsp;also be shared in the lecture itself.</p>\r\n\r\n<p>The resources include video lectures and links.</p>\r\n',51,11),(294,'<p>The Event will test your networking skills as a programmer on the simulation software . Participants have to design their own LAN as per the requirements of the problem statement .&nbsp;</p>\r\n',51,2),(295,'<p>Round 1: A objective type quiz based on basics of Networking (Architecture and Devices)&nbsp;.</p>\r\n\r\n<p>Round 2:Problem statement for the second round will be given when participants will clear the first round . It will be a design and simulation of network for an industry based on a specific set of limitations and constraints provided during the event.</p>\r\n\r\n<p>The simulation software will be &quot;Cisco Packet Tracer&quot;</p>\r\n',51,7),(296,'<ul>\r\n	<li>Online Registration is Active</li>\r\n	<li>For those who haven&#39;t registered online there Will be On Spot Registration</li>\r\n</ul>\r\n',70,12),(297,'<p style=\"text-align:justify\"><span style=\"font-size:16px\">Problem Statement<strong> </strong>will be provided on the spot.</span></p>\r\n',26,7),(298,'<p style=\"text-align:justify\"><strong><span style=\"font-size:16px\">Hydraulic Jack</span></strong><span style=\"font-size:16px\"> is a lifting device which uses hydraulic power to lift up heavy loads with relatively smaller force.&nbsp; <strong>Civil Students Society </strong>presents <strong>Lift-it-Up </strong>which provides an opportunity to the participants to combine the principles of fluid mechanics and their imagination to make an efficient and powerful jack. </span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">The paricipants are required to come in team of 3 or 4.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">For more details please contact :</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Suraj Modani: +91 8107839944</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Bharat Gandhi: +91 7891772365</span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n',26,2),(299,'<p><span style=\"font-size:16px\">Registrations will be done on-spot.</span></p>\r\n',26,12),(300,'<p><span style=\"font-size:16px\">Event is open for everyone!</span></p>\r\n',26,4),(301,'<p>You can&rsquo;t, but your intelligence can rule at different places simultaneously! <strong>plAI</strong> (pronounced as &quot;play&quot;) is a competition based on your artificial intelligence skills .&nbsp;Develop (Code in C++) an AI bot for the provided video-game interface. It will compete against bots programmed by other contestants .&nbsp;You will be given a Dumb bot which you have to code to get past the hurdles .</p>\r\n',52,2),(302,'<p>The Game is about two players&nbsp;competing in an AI developed arena&nbsp;to collect as many points as possible in a given time and also beat the opponent&#39;s player&nbsp;.You are expected to implement an AI function which, on taking certain player&nbsp;parameters&nbsp;as input, decides what the player is to do next .&nbsp;You will be required to submit a header file and a cpp file. Refer the &quot;Bot Coding Guide&quot; in resources for specific details.&nbsp;</p>\r\n',52,7),(303,'<p><strong>Parameters known to the AI function :</strong></p>\r\n\r\n<p>&bull;The map points inside or on the circle of visibility.</p>\r\n\r\n<p>&bull;Positions of all places to collect points&nbsp;within the circle of visibility.</p>\r\n\r\n<p>&bull;Player&#39;s&nbsp;own state parameters: position, velocity, Point count, remaining health.</p>\r\n\r\n<p>&bull;Other game parameters such as map width, map height, time remaining, etc. (refer informationProvider.h).</p>\r\n\r\n<p>&bull;Position of opponent player if it is within the circle of visibility.</p>\r\n\r\n<p><strong>The Map :</strong></p>\r\n\r\n<p>The map is made up of two kind of regions: traversable by Players, and not traversable&nbsp;(obstacles).</p>\r\n\r\n<p>If a player happens to hit an obstacle&nbsp; during the game, it gets bounced off and faces some damage .</p>\r\n\r\n<p>&nbsp;Every map has points scattered around. The number of points in the map are limited in a match. Moreover, point&nbsp;locations are fixed for a given map and do not change during a match.</p>\r\n\r\n<p><strong>The Player :</strong></p>\r\n\r\n<p>&bull;Your AI function must return three controls:</p>\r\n\r\n<p>&bull;Thrust vector (A 2D vector of magnitude less than or equal to 1). This vector is responsible for causing player&#39;s acceleration. Higher the magnitude, more the acceleration.</p>\r\n\r\n<p>&bull;Brake (a Boolean variable). Setting it &lsquo;true&rsquo; turns on drag brakes, due to which the player slows down at rate proportional to square of its speed. The drag-brake constant is very high.</p>\r\n\r\n<p>&bull;Cannon Vector (A 2D vector). Setting this vector to a non-zero value causes the player&nbsp;to fire , direction&nbsp;of which, is governed by this vector.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n',52,10),(304,'<p>&bull;A match between two contestants will go on until:</p>\r\n\r\n<p>&nbsp;Time runs out (3 minutes) or no points remain&nbsp;in the map, in case of&nbsp;which, the player which manages to capture maximum number of points will be awarded victory.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; OR</p>\r\n\r\n<p>One player gets completely damaged and destroyed, in case of which, the opponent player will be declared victorious.</p>\r\n\r\n<p>&bull;In case of a tie, the player which had captured the last point during the match wins .</p>\r\n\r\n<p>&bull;If no ship could capture even one point , then there will be a rematch on a different map.</p>\r\n',52,6),(305,'<p><span style=\"color:#000000\"><strong><span style=\"font-size:18px\">Deatailed Rules For Various Rounds</span></strong></span></p>\r\n\r\n<p><span style=\"color:#000000\">1) Elims (16 ques)</span></p>\r\n\r\n<p><span style=\"color:#000000\">2) Timeline-6 teams (6 ques)</span></p>\r\n\r\n<p><span style=\"color:#000000\">3) Toons-6 teams ( 6 cartoons)</span></p>\r\n\r\n<p><span style=\"color:#000000\">4) Pic connect &ndash; 6 teams (6 ques)</span></p>\r\n\r\n<p><span style=\"color:#000000\">5) Wild card +1 -2</span></p>\r\n\r\n<p><span style=\"color:#000000\">6) Seedhi baat- 5 (5 videos)</span></p>\r\n\r\n<p><span style=\"color:#000000\">7) Saakshatkar - 5 (5ques)</span></p>\r\n\r\n<p><span style=\"color:#000000\">8) Pehchaan Kaun- 3 (3ques)</span></p>\r\n\r\n<p><span style=\"color:#000000\">9 )Faking news- 3 (6 ques)</span></p>\r\n\r\n<p><span style=\"color:#000000\"><strong><u>Elims :-</u></strong></span></p>\r\n\r\n<ul>\r\n	<li><span style=\"color:#000000\">16 general knowledge based questions (from various fields)&nbsp;(5 starred)</span></li>\r\n	<li><span style=\"color:#000000\">+5 and -1</span></li>\r\n	<li><span style=\"color:#000000\">45 secs to ans.</span></li>\r\n	<li><span style=\"color:#000000\">Starred questions will give advantage in case of tie.</span></li>\r\n	<li><span style=\"color:#000000\">Questions of all variety</span></li>\r\n	<li><span style=\"color:#000000\">6 teams will be selected</span></li>\r\n</ul>\r\n\r\n<p><span style=\"color:#000000\"><strong><u>Timeline</u></strong></span></p>\r\n\r\n<ul>\r\n	<li><span style=\"color:#000000\">A series of 4 events will be shown to the participants and they will have to arrange it in chronological order of their occurrences.</span></li>\r\n	<li><span style=\"color:#000000\">6 teams;</span></li>\r\n	<li><span style=\"color:#000000\"><strong>Buzzer Round</strong></span></li>\r\n	<li><span style=\"color:#000000\"><strong>+20 for correct order; -10 for wrong answers. No partial marking</strong></span></li>\r\n	<li><span style=\"color:#000000\">For 45 sec , q will be shown and if not answered, it will be passable to audience.</span></li>\r\n	<li><span style=\"color:#000000\">Once the buzzer is pressed , only 5secs to ans. Any sort of delay in answering after pressing the buzzer will lead to negative marks.</span></li>\r\n	<li><span style=\"color:#000000\">No elimination.</span></li>\r\n	<li><span style=\"color:#000000\"><strong>Regarding&nbsp; buzzer pressing, decision of technical team will be final. Any sort of tie in buzzer will lead to tossing a coin or chit system</strong>.</span></li>\r\n</ul>\r\n\r\n<p><span style=\"color:#000000\"><strong><u>TOONS Bolte hain:-</u></strong></span></p>\r\n\r\n<ul>\r\n	<li><span style=\"color:#000000\">3pictures, with a dialogue box in each, will be shown for 10 sec each and then a final collage of all pics will be shown for 5 mins.</span></li>\r\n	<li><span style=\"color:#000000\">Sheets will be distributed to the participants where they will have to fill in the dialogue boxes in this allotted 5 minutes.</span></li>\r\n	<li><span style=\"color:#000000\">The dialogue boxes should be filled with crisp and humorous contents&hellip;the participants will be judged on the same.</span></li>\r\n	<li><span style=\"color:#000000\">Humour-05</span></li>\r\n	<li><span style=\"color:#000000\">Creativity &ndash; 05</span></li>\r\n	<li><span style=\"color:#000000\">Relevance of Statement(/subject) &ndash; 10(Ask for the explaination of it from seniors again)</span></li>\r\n	<li><span style=\"color:#000000\"><strong>No elimination</strong></span></li>\r\n	<li><span style=\"color:#000000\"><strong>Judge decision will be fina</strong>l</span></li>\r\n	<li><span style=\"color:#000000\">Scores of this round will be told after round 3.</span></li>\r\n</ul>\r\n\r\n<p><span style=\"color:#000000\"><strong><u>Pic Connect</u></strong></span></p>\r\n\r\n<ul>\r\n	<li><span style=\"color:#000000\">6 ques 6teams</span></li>\r\n	<li><span style=\"color:#000000\">+30 for correct order; -10 for wrong answers.</span></li>\r\n	<li><span style=\"color:#000000\">For 45 sec , q will be shown and if not answered, it will be passable to audience.</span></li>\r\n	<li><span style=\"color:#000000\">Once the buzzer is pressed , only 5secs to ans. Any sort of delay in answering after pressing the buzzer will lead to negative marks.</span></li>\r\n	<li><span style=\"color:#000000\">Buzzer Round</span></li>\r\n	<li><span style=\"color:#000000\">2 teams will be eliminated.</span></li>\r\n</ul>\r\n\r\n<p><span style=\"color:#000000\"><strong><u>Wild Card Entry</u></strong><strong>:-</strong></span></p>\r\n\r\n<ul>\r\n	<li><span style=\"color:#000000\">A questionnaire will be distributed to audience after elims are over.</span></li>\r\n	<li><span style=\"color:#000000\">This will be collected after the end of Toons Bolte hain .</span></li>\r\n	<li><span style=\"color:#000000\">After Pic Connect 2 teams with lowest points will be eliminated and one team will get a wild card entry.</span></li>\r\n	<li><span style=\"color:#000000\">20 questions of objective type each of 1 mark.</span></li>\r\n	<li><span style=\"color:#000000\">Star marked q&rsquo;s will be deciding factor in case of tie.</span></li>\r\n</ul>\r\n\r\n<p><span style=\"color:#000000\"><strong><u>Seedhi Baat All Bakwaas</u></strong> :-</span></p>\r\n\r\n<p><span style=\"color:#000000\">Nullification of score</span></p>\r\n\r\n<ul>\r\n	<li><span style=\"color:#000000\">Crazy news videos (without audio) will be shown to the teams for one time and then within 10 seconds the participants will have to start reporting on them.</span></li>\r\n	<li><span style=\"color:#000000\">Judging criteria includes &lsquo;Presentation skills(10)&rsquo;, &lsquo;Language clarity(05)&rsquo;, &lsquo;Content quality(10)&rsquo; and &lsquo;fun element(15)&rsquo;.</span></li>\r\n	<li><span style=\"color:#000000\">No elimination.</span></li>\r\n	<li><span style=\"color:#000000\">5teams; 1 Q each.</span></li>\r\n	<li><span style=\"color:#000000\"><strong><u>Decision of judge will be final.</u></strong></span></li>\r\n</ul>\r\n\r\n<p><span style=\"color:#000000\"><strong><u>Saakshatkaar</u></strong></span></p>\r\n\r\n<ul>\r\n	<li><span style=\"color:#000000\">Every team will be given 4 fields viz. Entertainment,Sports, Politics, Miscellenious. They will get one field via dart board system and they can select any character from that field. And then one will be the Interviewer and the other Interviewee.</span></li>\r\n	<li><span style=\"color:#000000\">Repetition of characters is not allowed.</span></li>\r\n	<li><span style=\"color:#000000\">&nbsp;Every team gets 45 seconds to think on the subject</span></li>\r\n	<li><span style=\"color:#000000\">Interview of min 2 min and max 4 min.</span></li>\r\n	<li><span style=\"color:#000000\">Humour(10)</span></li>\r\n	<li><span style=\"color:#000000\">Character Adaptation(20)</span></li>\r\n	<li><span style=\"color:#000000\">Standard of question(10)</span></li>\r\n	<li><span style=\"color:#000000\">5 teams;&nbsp; 1 Q each.</span></li>\r\n	<li><span style=\"color:#000000\">2 teams will be eliminated.</span></li>\r\n	<li><span style=\"color:#000000\"><strong><u>Decision of judges will be final</u></strong></span></li>\r\n</ul>\r\n\r\n<p><span style=\"color:#000000\"><strong><u>Pehchaan Kaun</u></strong></span></p>\r\n\r\n<ul>\r\n	<li><span style=\"color:#000000\">It revolves around some of the famous India Centric controversies.</span></li>\r\n	<li><span style=\"color:#000000\">A statement or audio clip will be provided.</span></li>\r\n	<li><span style=\"color:#000000\">Participants have to answer part wise starting from part (a). Any wrong answer will then become open to all other teams. </span></li>\r\n	<li><span style=\"color:#000000\">3 teams; 3 q&rsquo;s ; but it is&nbsp; a buzzer round.</span></li>\r\n	<li><span style=\"color:#000000\"><strong>Part a-(5 marks); b-(10 marks); c-(15marks</strong>)</span></li>\r\n	<li><span style=\"color:#000000\">Negative of 5 marks for every wrong ans.</span></li>\r\n	<li><span style=\"color:#000000\">45 secs to ans.</span></li>\r\n	<li><span style=\"color:#000000\">Passable to other teams.</span></li>\r\n	<li><span style=\"color:#000000\"><strong>No elimination</strong>.</span></li>\r\n</ul>\r\n\r\n<p><span style=\"color:#000000\"><strong><u>Faking News</u></strong></span></p>\r\n\r\n<ul>\r\n	<li><span style=\"color:#000000\">6 questions</span></li>\r\n	<li><span style=\"color:#000000\"><strong>Buzzer Round</strong></span></li>\r\n	<li><span style=\"color:#000000\">45 sec for pressing the buzzer</span></li>\r\n	<li><span style=\"color:#000000\">Only 5 secs &nbsp;will be given to ans after pressing the buzzer.</span></li>\r\n	<li><span style=\"color:#000000\"><strong><u>+ 20&nbsp; -10</u></strong></span></li>\r\n</ul>\r\n',5,3),(306,'<p>Registration is on the spot.</p>\r\n\r\n<p>Teams of three only.</p>\r\n\r\n<p>&nbsp;</p>\r\n',4,12),(307,'<p>The classic word game Taboo! returns for yet another iteration this APOGEE.</p>\r\n\r\n<p>Want to expand your vocabulary and strengthen your powers of communication?</p>\r\n\r\n<p>Turn up for Taboo with your friends!</p>\r\n',4,2),(308,'<p>Teams of 3 only.</p>\r\n\r\n<p>Verbal communication only, no signalling of any kind allowed.</p>\r\n\r\n<p>Each team is given a few&nbsp;minutes.</p>\r\n\r\n<p>Points cancelled if&nbsp;Taboo words are used.</p>\r\n\r\n<p>Points are given for every word the team solves.</p>\r\n\r\n<p>Highest score advances to the next round/wins.</p>\r\n',4,3),(309,'<p>All college students are eligible.</p>\r\n\r\n<p>Come in teams of 3!</p>\r\n',4,4),(310,'<p>Points given for each word solved.</p>\r\n\r\n<p>Points are cancelled if a Taboo word is used.</p>\r\n',4,6),(311,'<p>Check out the Taboo! game online or the popular mobile app for sample questions.</p>\r\n',4,9),(312,'<p>All college students are eligible.</p>\r\n',3,4),(313,'<p>Registration is on the spot.</p>\r\n',3,12),(314,'<p>Use your creativity and scientific ingenuity to hypothesize the origin of the universe or even better, create one of your fancy! This game will become the answer to everything in life and in the universe. Online elims have begun. Check out the&nbsp;Problem Statements and Guidelines.</p>\r\n\r\n<p>Follow Mr. Garner in his adventures through outer space, which are described in the problem statements and devise your&nbsp;way out of the difficulties that arise in front of him. You may build your theory or use one that already exists. Wherever&nbsp;you choose to build a hypothesis,&nbsp;you must be able to prove it mathematically.</p>\r\n\r\n<p><u>For further information, contact:</u></p>\r\n\r\n<address>A.L.Soumya</address>\r\n\r\n<address>8239822068</address>\r\n\r\n<address>Keshav P. Nair</address>\r\n\r\n<address>7728095601</address>\r\n',13,2),(315,'<ul>\r\n	<li>The event consists of 3 offline rounds along with one online Elimination Round</li>\r\n	<li>Questions will get more challenging with the rounds.</li>\r\n	<li>Teams of maximum 2 members can apply.</li>\r\n</ul>\r\n',13,3),(316,'<p>The three problem sets are :&nbsp;</p>\r\n\r\n<p><a href=\"http://bits-apogee.org/intro/docs/q1.pdf\" target=\"_blank\">http://bits-apogee.org/intro/docs/q1.pdf</a></p>\r\n\r\n<p><a href=\"http://bits-apogee.org/intro/docs/q2.pdf\" target=\"_blank\">http://bits-apogee.org/intro/docs/q2.pdf</a></p>\r\n\r\n<p><a href=\"http://bits-apogee.org/intro/docs/q3.pdf\">http://bits-apogee.org/intro/docs/q3.pdf</a></p>\r\n',13,7),(317,'<ol>\r\n	<li>\r\n	<p>Team size of maximum 2 particiapnts is allowed.</p>\r\n	</li>\r\n	<li>\r\n	<p>The event consists of two rounds. Based on the score obtained in the first round,<br />\r\n	teams will be shortlisted for the second round.</p>\r\n	</li>\r\n	<li>\r\n	<p>No internet access or books are allowed.</p>\r\n	</li>\r\n	<li>\r\n	<p>In case of any disputes,discrepancies, the organisers&#39; decision will be final and binding.</p>\r\n	</li>\r\n</ol>\r\n',57,3),(318,'<p>Any undergraduate student of BITS PILANI can participate.</p>\r\n',57,4),(319,'<p>The teams will be shortlisted for the final round based on their score in the first round.</p>\r\n\r\n<p>The team scoring highest in the second round will be declared the winner.</p>\r\n\r\n<p>The desicion of the organisers will be final and binding.</p>\r\n',57,6),(320,'<p><span style=\"font-size:18px\"><strong>Round 1 :</strong></span> A quiz consisting of objective type questions testing the basic knowledge of<br />\r\nANALOG circuits and devices.<br />\r\n&nbsp;</p>\r\n\r\n<p><span style=\"font-size:18px\"><strong>Round 2 :</strong></span> A problem statement based on analog design will be provided at the spot.<br />\r\nThe problem will test the level of understanding and knowledge of partcipant in the feild of<br />\r\ndesigning of analog circuits. Participants have to design and simulate their model using Cadence<br />\r\ntools provided in the O-Lab.</p>\r\n',57,7),(321,'<p>On Spot registration</p>\r\n',57,12),(322,'<ul>\r\n	<li><strong>Do I need to register on BITS Apogee 2016 website?</strong><br />\r\n	Yes</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li><strong>Can I participate individually in the event?</strong><br />\r\n	No, a team of 3- 5 members is required.</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li><strong>Can I make a team with students from other institutions?</strong><br />\r\n	Yes. You just need to enter the ID&rsquo;s of different members while registering for the team event which is given by APOGEE upon the initial registration.</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li><strong>Do I need to bring laptop for final round during APOGEE?</strong><br />\r\n	Final round requires you to provide CAD/Engineering drawings for which at least 2 laptops are recommended. If not possible, laptops will be provided on-site with proper softwares.</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li><strong>Can I provide engineering drawings manually/hand-drawn?</strong><br />\r\n	Yes, we will provide chart papers/stationeries, if required by any team.</li>\r\n</ul>\r\n',60,13),(323,'<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><strong>Do I need to register on BITS Apogee 2016 website?</strong><br />\r\n	Yes</li>\r\n	<li><strong>Can I participate individually in the event?</strong><br />\r\n	No, a team of 2- 4&nbsp;members is required.</li>\r\n	<li><strong>Can I make a team with students from other institutions?</strong><br />\r\n	Yes. You just need to enter the ID&rsquo;s of different members while registering for the team event which is given by APOGEE upon the initial registration.&nbsp;</li>\r\n	<li><strong>Do I need to bring the hard copies for final round during APOGEE?</strong><br />\r\n	Yes, you should carry hard copy of the abstract, paper and the sketch/CAD and submit it before the final Presentation.</li>\r\n	<li><strong>Can I provide Design sketches/drawings manually?</strong><br />\r\n	Yes, for those who don&rsquo;t have sufficient CAD expertise in any of the software can submit a hand-made sketch/drawing. No points will be deducted.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n',59,13),(324,'<p><span style=\"font-size:14px\">The event is divided into 3 phases:</span></p>\r\n\r\n<p><span style=\"font-size:14px\">Phase 1: Submission of the Executive Summary (Deadline <strong>21th February 2016)</strong>.</span></p>\r\n\r\n<p><span style=\"font-size:14px\">Phase 2: Mentor-ship Phase (Mentor will be provideded for guidance until your Final Presentation).</span></p>\r\n\r\n<p><span style=\"font-size:14px\">Phase 3: Final Presentation of Complete Business Plan in front of a panel of judges at BITS Pilani.<strong>(27th February 2016)</strong></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Avish Jain</p>\r\n\r\n<p>+91-8239546496</p>\r\n',19,2),(325,'<p><span style=\"font-size:14px\">Participation will be in teams of atmost <em>four</em> people.</span></p>\r\n\r\n<p><span style=\"font-size:14px\">The participants will bear their travel and accommodation on their own.</span></p>\r\n\r\n<p><span style=\"font-size:14px\">During all stages of the event, the decision of the&nbsp;judge will be considered as final and should be respected by the participants.</span><br />\r\n&nbsp;</p>\r\n',19,3),(326,'<p><strong><span style=\"font-size:16px\">NOTE:</span></strong>&nbsp;<span style=\"font-size:14px\">The questions are all somehow related to narcotics.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:16px\"><strong>THE CHALLENGE:</strong></span> <span style=\"font-size:14px\">The answers are not always drugs ;)</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:16px\"><strong>REMEMBER:</strong></span> <span style=\"font-size:14px\">&ldquo;Knowledge is the prime high.&rdquo;</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Avish Jain</p>\r\n\r\n<p>+91-8239546496</p>\r\n\r\n<p>&nbsp;</p>\r\n',20,2),(327,'<ol>\r\n	<li><span style=\"font-size:14px\">Participation will be on individual basis.</span></li>\r\n	<li><span style=\"font-size:14px\">Only when a question has been answered will the next question pop up.&nbsp;</span></li>\r\n	<li><span style=\"font-size:14px\">Two lifelines will be provided at different stages of the competition</span></li>\r\n</ol>\r\n\r\n<ul>\r\n	<li><span style=\"font-size:14px\">&nbsp;Know My Number: This lifeline would provide the participants with the number of letters in the answer. This would be available&nbsp;from&nbsp;the&nbsp;beginning.</span></li>\r\n	<li><span style=\"font-size:14px\">&nbsp;Sneak Peak: This lifeline would be made available once you&rsquo;ve answered the first 15 questions correctly. The use of&nbsp;this lifeline would be to provide the first and the last letter of the answer.</span></li>\r\n</ul>\r\n',20,3),(328,'<p><span style=\"font-size:14px\">The first individual to answer all the questions correctly after the completion of the event would be declared as the winner, similarly second and third position will be declared.</span></p>\r\n',20,6),(329,'<p><span style=\"font-size:14px\">The questions will be related to the street drugs and common medicines.</span></p>\r\n\r\n<p>The answers are not always drugs.&nbsp;</p>\r\n',20,7),(330,'<p><span style=\"font-size:14px\">The submitted entries will be judged on the basis of their economic outcomes, feasibility and some of them will be filtered out during each stage.</span></p>\r\n\r\n<p><span style=\"font-size:14px\">The finalized B-Plans will be judged by a panel of judges on the basis of their presentation of the ideas.</span></p>\r\n',19,6),(331,'<p><span style=\"font-size:14px\">The first stage includes <strong>submission of the executive summary for your business plan to pharmaapogee@gmail.com</strong>, the last date for the submission is <strong>21th February 2016</strong>. </span></p>\r\n\r\n<p><span style=\"font-size:14px\">Results of the first stage will be declared on <strong>22<sup>th</sup> February 2016.</strong>&nbsp;</span></p>\r\n\r\n<p>Format of Executive Summary:</p>\r\n\r\n<ol>\r\n	<li><strong>Title</strong></li>\r\n	<li>Brief Introduction (Background of the Healthcare problem you are addressing to).</li>\r\n	<li>Objective(s)</li>\r\n	<li>Strategy (Specify Steps, a brief focus on each of them would be sufficient)</li>\r\n	<li>Target Groups</li>\r\n	<li>Economic Outcomes\r\n	<ol style=\"list-style-type:lower-alpha\">\r\n		<li>Towards the entire healthcare sector</li>\r\n		<li>Towards general public/ consumers/ citizen of the country</li>\r\n		<li>Benefits to the business</li>\r\n	</ol>\r\n	</li>\r\n	<li>Keys to success (Describe concisely in less than 50 words)\r\n	<ol style=\"list-style-type:lower-alpha\">\r\n		<li>Implementation strategies</li>\r\n		<li>Finances</li>\r\n		<li>Management</li>\r\n		<li>Marketing</li>\r\n		<li>Others</li>\r\n	</ol>\r\n	</li>\r\n	<li>What gives you an edge over your competitors (if any)?</li>\r\n	<li>Conclusion</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n',19,12),(332,'<p><span style=\"font-size:14px\">The B-Plan should somehow reflect a betterment in healthcare services.</span></p>\r\n',19,7),(333,'<p>Updates coming soon...</p>\r\n',20,12),(334,'<p>1. All robots should fit in a box of size 30cmX30cm. There is no limit on the height.</p>\r\n\r\n<p>2. Robots should not leave behind parts or damage the track in any manner.</p>\r\n\r\n<p>3. Teams are allowed to bring only one robot.</p>\r\n\r\n<p>4. Only 1 member of the team is allowed to handle the bot.</p>\r\n\r\n<p>5. Participants are not allowed to keep anything inside the arena other than the bot.</p>\r\n\r\n<p>6. Laptops/personal computers are not allowed near the arena.The bot should not receive any kind of input from outside the arena.</p>\r\n\r\n<p>7. The time measured by the organisers will be final and will be used for scoring the teams.</p>\r\n\r\n<p>8. No external power supply will be provided. Only batteries are allowed as power source.</p>\r\n\r\n<p>9. In case of any disputes/discrepancies, the organisers&#39; decision will be final and binding. The organisers hold the right to disqualify any robot found violating any of the rules above.</p>\r\n\r\n<p>10. The organisers reserve the rights to change any or all of the above rules as they deem fit. Change in rules, if any will be highlighted on the website and notified to the registered teams.</p>\r\n',37,3),(335,'<p><span style=\"font-size:18px\">Round 1</span> : A straight forward track consisting of some &quot;U&quot; turns and right angle turns. Complete the track in the minimum time possible.</p>\r\n\r\n<p><span style=\"font-size:18px\">Round 2</span> : Start from the start point and reach the centre of the track, keeping track of the path traversed. Detect the tag in the centre and glow a RED LED. Traverse back to the starting point via the <strong>SHORTEST PATH</strong> possible. The time taken to traverse back to the start from the centre will account for performance of the bot.&nbsp;</p>\r\n\r\n<p><strong>NOTE :</strong> Refer to sample question for a sample track.</p>\r\n',37,7),(337,'<p>Sample Track :</p>\r\n\r\n<p><br />\r\n<img alt=\"\" src=\"http://bits-apogee.org/intro/images/tom.png\" style=\"height:326px; width:300px\" /></p>\r\n\r\n<p><strong>NOTE :&nbsp;</strong>The actual track may vary the illustration</p>\r\n',37,9),(338,'<p>The teams will be shortlisted for the final round based on their score in the first round.</p>\r\n\r\n<p>The team scoring highest in the second round will be declared the winner.</p>\r\n\r\n<p>The desicion of the organisers will be final and binding.</p>\r\n',51,6),(339,'<ol>\r\n	<li>Team size of maximum 2 particiapnts is allowed.</li>\r\n	<li>The event consists of two rounds. Based on the score obtained in the first round,&nbsp;teams will be shortlisted for the second round.</li>\r\n	<li>Round 1 will be of 1 hour and only 2 hours will be provided&nbsp;for round 2.</li>\r\n	<li>Team completing most of the part of the event would be declared as winner</li>\r\n	<li>Internet access or books are allowed.</li>\r\n	<li>In case of any disputes,discrepancies, the organisers&#39; decision will be final and binding.</li>\r\n</ol>\r\n',51,3),(340,'<p style=\"text-align:justify\"><strong>General Rules: </strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">The aircraft must fit a box of <strong>dimensions</strong>: <strong>40&rdquo; * 40&rdquo; * 15&rdquo; </strong>at all points of time during the competition. The aircraft must <strong>necessarily </strong>be <strong>fixed wing</strong>. <strong>Helicopter designs </strong>or <strong>designs involving variable propeller positions </strong>like the Bell-Boeing Osprey are <strong>strictly prohibited</strong>. The aircraft should preferably be a low wing monoplane, for performance considerations. Usage of biplane designs is <strong>not </strong>prohibited.</li>\r\n	<li style=\"text-align:justify\">There is <strong>NO </strong>restriction on the weight of the aircraft.</li>\r\n	<li style=\"text-align:justify\">The aircraft must be powered by a <strong>single forward mounted electric motor </strong>with an electronic speed control unit. The use of Lithium Polymer batteries is suggested. Use of IC engine for propelling is strictly prohibited.</li>\r\n	<li style=\"text-align:justify\">The radio control system must <strong>at-least have 4 channels </strong>to control yaw, pitch, roll and throttle. The radio control system should preferably be from a reputed brand like Futaba, Hitec, and Tower Hobbies etc. for the safety considerations of the spectators and the participants themselves.</li>\r\n	<li style=\"text-align:justify\">The participants may choose to use additional channels for better control or for incorporating novelties like retractable landing gears. This however, is not necessary and will not be awarded any additional credit.</li>\r\n	<li style=\"text-align:justify\">The participants are free to use propellers having as many blades as they desire. The <strong>use of push-propellers</strong>, however, is <strong>not allowed</strong>.</li>\r\n	<li style=\"text-align:justify\">The Participants are <strong>not allowed </strong>to use <strong>ARF (Almost Ready to Fly) </strong>or <strong>RTF (Ready to Fly) </strong>aircraft. However, kits with plans and pre-cut balsa parts are allowed, as building skills are necessary for making these aircraft.</li>\r\n	<li style=\"text-align:justify\"><strong>Potential difference </strong>between any two points <strong>can&rsquo;t exceed 12 Volts </strong>at any point of time during the competition.</li>\r\n	<li style=\"text-align:justify\">The participants must report to the <strong>SAE stall half an hour before </strong>the <strong>event slot </strong>for both elimination and finals and <strong>submit </strong>their <strong>transmitters</strong>. The actual event will be held in <strong>Medical Centre grounds</strong>. Participants will be <strong>allowed to modify </strong>their <strong>aircraft </strong>till their <strong>turn arrives</strong>. Before the actual flight, participants will be <strong>allowed to prep </strong>their aircraft for <strong>10 minutes</strong>. Once on the runway, the participants might <strong>prep </strong>their aircraft for <strong>3 minutes </strong>and <strong>declare </strong>their readiness <strong>before taking off</strong>. <strong>Turns </strong>will be <strong>decided </strong>by <strong>lots </strong>for <strong>eliminations </strong>and <strong>randomly </strong>by the <strong>organizers </strong>for the <strong>finals</strong>.</li>\r\n	<li style=\"text-align:justify\">It is the <strong>participant&rsquo;s duty </strong>to look at a copy of the <strong>judge sheet </strong>and <strong>rule book </strong>provided, <strong>before attempting the run</strong>. <strong>No grievances </strong>will be <strong>entertained </strong>later.</li>\r\n	<li style=\"text-align:justify\">In all cases, the decision of the <strong>organizers </strong>and/or the <strong>judges </strong>is <strong>final and binding</strong>.</li>\r\n</ul>\r\n\r\n<p style=\"text-align:justify\"><strong>Elimination Rules:</strong></p>\r\n\r\n<p style=\"text-align:justify\">There will be 2 rounds in all.</p>\r\n\r\n<p style=\"text-align:justify\"><strong>Round 1: </strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">This will be an elimination round.</li>\r\n	<li style=\"text-align:justify\">All teams will be given <strong>2 heats </strong>to fly their aircrafts over a prescribed area as shown in fig.1</li>\r\n	<li style=\"text-align:justify\">Total flight time, from leaving the ground to landing back will be noted. For each second of flying time<strong>, 2 points </strong>will be awarded to the team. This will be done for all the 3 heats. The best among the 3 will be taken for evaluation against other team&rsquo; timings.</li>\r\n	<li style=\"text-align:justify\">For each second of flying out of the arena<strong>, -1.5 points </strong>will be awarded. No warning will be given by the linesmen for going out of the arena.</li>\r\n	<li style=\"text-align:justify\">There are bonus points for taking off from the ground and safe landing back.</li>\r\n	<li style=\"text-align:justify\">For taking off, <strong>a bonus of 50 points </strong>will be awarded.</li>\r\n	<li style=\"text-align:justify\">For safe landing back, <strong>a bonus of 50 points </strong>will be awarded.</li>\r\n	<li style=\"text-align:justify\">No extra points will be awarded for teams choosing to hand-launch their aircrafts.</li>\r\n	<li style=\"text-align:justify\">The decision of whether an aircraft has safely landed back or not, solely rests on the organizers.</li>\r\n	<li style=\"text-align:justify\">The team scoring <strong>minimum number of points will be eliminated </strong>from the competition.</li>\r\n	<li style=\"text-align:justify\">There is not restriction on the amount of time a team decides to fly their aircrafts. It is upto the team to decide when to land back.</li>\r\n	<li style=\"text-align:justify\">There will not be any points awarded for performing aerobatics.</li>\r\n</ul>\r\n\r\n<p style=\"text-align:justify\"><strong>Round 2: </strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">This round requires teams to perform aerobatics in the zone prescribed by fig. 2</li>\r\n	<li style=\"text-align:justify\">Standard aerobatic maneuvers and their scoring is as follows:</li>\r\n</ul>\r\n\r\n<p style=\"margin-left:1in; text-align:justify\">&Oslash; Inversion and Knife Edge- <strong>50 points </strong></p>\r\n\r\n<p style=\"margin-left:1in; text-align:justify\">&Oslash; Barrel Roll- <strong>30 points </strong></p>\r\n\r\n<p style=\"margin-left:1in; text-align:justify\">&Oslash; Stall Turn-<strong>70 points </strong></p>\r\n\r\n<p style=\"margin-left:1in; text-align:justify\">&Oslash; Immelman &ndash; <strong>70 points </strong></p>\r\n\r\n<p style=\"margin-left:1in; text-align:justify\">&Oslash; Split S Turns &ndash; <strong>70 points </strong></p>\r\n\r\n<p style=\"margin-left:1in; text-align:justify\">&Oslash; Aerobatic Loop- <strong>30 points </strong></p>\r\n\r\n<p style=\"margin-left:1in; text-align:justify\"><span style=\"color:#FF0000\">PLEASE CHECK FIGURES ON GOOGLE</span></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">A team performing no aerobatic tricks and choosing only to fly regularly will be awarded <strong>40 points for a flight time of 150 seconds or more</strong>.</li>\r\n	<li style=\"text-align:justify\">For this round, teams must take off and land back after completing aerobatics<strong>. -10 points </strong>will be awarded to teams failing to land back safely. No negative points will be awarded for hand- launching , but <strong>+5 points </strong>will be awarded for taking off from the ground&nbsp;</li>\r\n	<li style=\"text-align:justify\">Teams can cross the prescribed area (fig 2.) a maximum of 2 times. Both times, they will be given warnings by the linesmen. On further crossing the boundary line, a 3 point penalty for each second out of the flying zone will be awarded.</li>\r\n	<li style=\"text-align:justify\">Once again, there is not restriction on the flying time and the kind of tricks. Though the scoring has been mentioned for common tricks performed in aerial aerobatics, tricks like torque roll etc, are encouraged. These will attract additional points as deemed fit by the organizers.</li>\r\n</ul>\r\n\r\n<p style=\"margin-left:0.25in; text-align:justify\"><strong>Final Scoring: </strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align:justify\">The <strong>cumulative score </strong>of the first and second rounds will be taken in the final scoring.</li>\r\n	<li style=\"text-align:justify\">The team accruing the highest score will be the winner.</li>\r\n</ul>\r\n\r\n<p><!--![endif]----></p>\r\n',75,3),(341,'<p>1st prize- 5,000/-</p>\r\n<p>2nd prize- 3,000/-</p>\r\n<p>3rdst prize- 2,000/-</p>\r\n\r\n\r\n<p> Sponsored by  Srikant Visweswariah\'s family in his loving memory. </p>',57,14),(342,'<p><u><strong>FAQs</strong></u></p>\r\n\r\n<p><strong>Q</strong>. Is online registration necessary?</p>\r\n\r\n<p><strong>A</strong>. No, you can get your RC plane which is competition ready and participate at the event which is being held &nbsp;at 10am on 26th Februaury.</p>\r\n\r\n<p><strong>Q</strong>. What are the specifications of the plane?</p>\r\n\r\n<p><strong>A</strong>. There are rules on the site which can be referred to for the specifications, sizes, etc. of the planes.</p>\r\n\r\n<p><strong>Q</strong>. What is the team size?</p>\r\n\r\n<p><strong>A</strong>. The team can be maximum of 5 members.</p>\r\n',75,13),(343,'<p>There is no online registration for the event.</p>\r\n\r\n<p>You can turn up at the medical center grounds on 26th February, at 10am for the event.</p>\r\n',75,12),(344,'<p>There are no specific problem statements for this event.</p>\r\n\r\n<p>You can consult the rules section for the requirements of the event.</p>\r\n\r\n<p>For more information, contact Siddhant Mehandru +91-77288-08131</p>\r\n',75,7),(345,'<p>UP IN THE AIR<br />\r\nIt is an event, where teams of 5 participate, by constructing a Remote-Controlled Plane and compete by performing various aerial acrobatics in a 60 second time span.</p>\r\n\r\n<p>The team with maximum acrobatic display is awarded the winner.</p>\r\n',75,2),(346,'<p><span style=\"font-size:18px\">An unconventional quizzing events in which you would be explaining seemingly impossible occurrences using physics you learned in high school.</span></p>\r\n\r\n<p><span style=\"font-size:18px\">One of the rounds includes placing stakes on questions just liker POKER.</span></p>\r\n\r\n<p><span style=\"font-size:18px\">And if you make it to the finals,&nbsp;you get to hypothesize your own theory using a bunch of hypothetical facts!</span></p>\r\n',81,2),(347,'<p>Anyone with a functioning brain and will to stretch their grey matter.&nbsp;</p>\r\n',81,4),(348,'<p><strong>Teams of 2</strong></p>\r\n\r\n<p>Quiz consists of 4 rounds -&nbsp;</p>\r\n\r\n<ol>\r\n	<li>A written qualification&nbsp;round on everyday physics.</li>\r\n	<li>Visuals round.</li>\r\n	<li>Poker</li>\r\n	<li>Hypothesize your theory.</li>\r\n</ol>\r\n\r\n<p>Note - Points are not carried forward to subsequent rounds.</p>\r\n',81,3),(349,'<p>Bring a pen and a partner. (and your thinking hat)</p>\r\n',81,5),(350,'<p><strong>Q. </strong>I don&#39;t like Physics. Should I still consider attending?</p>\r\n\r\n<p><strong>Ans.</strong> Absolutely Yes! You would learn a lot of interesting stuff to talk about when you hangout.</p>\r\n\r\n<p><strong>Q.</strong> But I don&#39;t hangout much?</p>\r\n\r\n<p><strong>Ans.</strong> Another great reason to attend. Hangout at this event with your friends.</p>\r\n\r\n<p><strong>Q. </strong>But i don&#39;t have friends?</p>\r\n\r\n<p><strong>Ans.</strong> One more reason to attend.&nbsp;You might make a few here!</p>\r\n',81,13),(351,'<div>Rules:</div>\r\n\r\n<div>\r\n<p>This APOGEE, Photography Club brings to you an all &lsquo;new&rsquo; and &lsquo;revamped&rsquo; version of our &ldquo;traditional&rdquo; exhibition-cum-competition &ldquo;Panorama&rdquo;, for all the shutterbugs and photography enthusiasts, who wish to show off their clicking skills to everyone else, and win prizes in the process.</p>\r\n</div>\r\n\r\n<div>\r\n<ul>\r\n	<li>This is an online event.</li>\r\n	<li>There are 4 categories under which entries can be given. The categories will be uploaded on photog page and posters.&nbsp;</li>\r\n	<li>Four Categories are: SOCIAL ISSUES, LONG EXPOSURE, STILL LIFE, ARCHITECTURE/LANDSCAPES.&nbsp;</li>\r\n	<li>The entry must be an original work of the participant.</li>\r\n	<li>A single participant can give Maximum Two entries for EACH category. It is NOT compulsory to participate in all four categories.</li>\r\n	<li>The entries must be submitted by the midnight of 24th February&nbsp;2016, in the format given below:\r\n	<ul>\r\n		<li>Name - Title_Category_Student Name_College Name_Phone no.jpeg</li>\r\n		<li>Minimum size - 1200 * 800 pixels</li>\r\n		<li>Aspect ratio - 3:2</li>\r\n	</ul>\r\n	</li>\r\n	<li>Entries are to be sent to&nbsp;photog.bits@gmail.com&nbsp;with the subject &quot;Panorama&quot;. The entry should clearly mention which category it belongs to. Kindly make sure there are no watermarks or captions on your entries.</li>\r\n</ul>\r\n\r\n<p>The best entries will be displayed in APOGEE&nbsp;2016&#39;s exhibition.</p>\r\n</div>\r\n',82,3),(352,'<ul>\r\n	<li>This is an online event.</li>\r\n	<li>Participants will be provided with a photograph which they will have to edit and send the entry to us. The final 10 selected entries will have to send the .psd files.</li>\r\n	<li>The entry must be an original work of the participant.</li>\r\n	<li>Entries are to be sent to&nbsp;photog.bits@gmail.com&nbsp;with the subject &quot;Layers&quot;.&nbsp;</li>\r\n	<li>The entries must be submitted by the midnight of 24th February&nbsp;2016.</li>\r\n	<li>Mention your personal and contact details in the body of the mail.</li>\r\n</ul>\r\n\r\n<p>The best entries will be displayed in APOGEE&nbsp;2016&#39;s exhibition.</p>\r\n',83,3),(353,'<ul>\r\n	<li>Anyone can participate in the event.</li>\r\n	<li>Any camera would work whether be it phone, DSLR, Digi-cam.</li>\r\n</ul>\r\n',82,4),(358,'<p>This APOGEE ASME BITS Pilani Chapter brings to you, <strong>Airborne</strong>- An RC Hovercraft Racing Competition.</p>\r\n\r\n<p style=\"text-align:center\">Date- 26th February</p>\r\n\r\n<p style=\"text-align:center\">Time- 2pm</p>\r\n\r\n<p style=\"text-align:center\">Venue- Rotunda</p>\r\n\r\n<p style=\"text-align: right;\">For queries contact:&nbsp;Devdutt S +919495581774</p>\r\n\r\n<p style=\"text-align: right;\">devdutt9996@gmail.com</p>\r\n',91,2),(359,'<p style=\"text-align: center;\"><strong>Problem Statement</strong></p>\r\n\r\n<p>Make a radio-controlled hovercraft that can complete a smooth track, ridden with obstacles, in minimum possible time.</p>\r\n',91,7),(360,'<p><strong>General Rules</strong></p>\r\n\r\n<ul>\r\n	<li>The vehicle must strictly and purely be a hovercraft, i.e., it should operate by creating a cushion of high-pressure air between the hull of the vessel and the surface below. Any other vehicular design will be rejected.</li>\r\n	<li>The hovercraft must fit inside a cube of side 50 cm.</li>\r\n	<li>The use of IC engines is strictly prohibited. Only electric motors will be allowed.</li>\r\n	<li>Use of ready-made actuators/motors, remote control units, electronic speed controllers and propellers is allowed.</li>\r\n	<li>The hovercraft must operate using wireless transmission.</li>\r\n	<li><strong><u>Maximum number of team members is 6.</u></strong></li>\r\n</ul>\r\n',91,3),(361,'<p><strong>Judging Criteria&nbsp;</strong></p>\r\n\r\n<ul>\r\n	<li>The track will be smooth with&nbsp;turns and obstacles. In this task, both speed and control will be important. The hovercraft should be able to&nbsp;<strong>cross the various obstacles on the track.</strong></li>\r\n	<li>The width of the track will be 80 cms .</li>\r\n	<li>The ramp shall have a slope of 10 degrees.</li>\r\n	<li>The course should be completed in minumum time.</li>\r\n	<li>In addition to the above track, which tests the maneuverability of the hovercraft, there will be an acceleration event in which the hovercraft is required to complete a straight distance of 20m in minimum time.</li>\r\n</ul>\r\n',91,6),(362,'<p>Both online and on-spot registration can be done for this event.</p>\r\n',91,12),(363,'<p><u>Online Elims Round:</u></p>\r\n\r\n<ul>\r\n	<li>Participants register in teams of two and solve&nbsp;the problem statements given on the website.</li>\r\n	<li>Any one question must be tackled. Answers to more than one question can also be sent.</li>\r\n	<li>Solutions for the problem statements of the online elims round can be sent to&nbsp;<a href=\"mailto:solutions42.apogee@gmail.com\" target=\"_blank\">solutions42.apogee@gmail.com</a></li>\r\n	<li>The solutions have to be sent as pdf file attachments with the subject TeamMember1_TeamMember2_QuestionNumber</li>\r\n	<li>The winning team&nbsp;of the online elimination round gets a wildcard entry into the second round that will happen on campus during APOGEE.</li>\r\n	<li>Deadline for turning in solutions is 25th Feb 11:59 pm.</li>\r\n	<li>Winners of Online elims will be announced on 26th Feb at 5pm.&nbsp;</li>\r\n</ul>\r\n\r\n<p><u>Offline Rounds:</u></p>\r\n\r\n<ul>\r\n	<li>Consist of 3 rounds</li>\r\n	<li>Winners of the Online Elims Round&nbsp;will join the winners of Round 1&nbsp;in Round 2.</li>\r\n	<li>Date | Time | Venue:&nbsp;27th Feb | 12 pm | FD 2220</li>\r\n</ul>\r\n',13,5),(364,'<p><span style=\"font-size:14px\"><strong><u>ERRATA:</u></strong></span></p>\r\n\r\n<ul>\r\n	<li><span style=\"font-size:14px\"><span style=\"color:rgb(0, 0, 0)\">In the equations used in QUESTION 2, (distance from supernova) is raised to the power seven and not multiplied by 7. Similarly in the second equation, in the denominator (distance from supernova) is raised to power 2.</span></span></li>\r\n	<li><span style=\"font-size:14px\"><span style=\"color:rgb(0, 0, 0)\">In QUESTION 3, it is </span>&xi;<span style=\"background-color:transparent; color:rgb(0, 0, 0)\">-bosons. You may write it as xi-bosons, instead of copying the symbol at every place.</span></span></li>\r\n</ul>\r\n',13,8);
