INSERT INTO `backend_updates` VALUES (1,'Result of IOT Challenge 2016','<p>&nbsp;The results for the first round of TI presents IOT Challenge 2016 are out. Check out the results at bits-apogee.org/2016/iot/</p>\r\n\r\n<p>Congratulations to all the finalized teams !</p>\r\n','2016-02-03'),(2,'Extension of Deadlines','<p>The last date for the registration of events :&nbsp;<strong>Innover&nbsp;</strong>has been extended till Sunday, 14th February 2016.</p>\r\n','2016-02-10'),(3,'Extension of Deadline for AIC','<p>The deadline for certain problem statements of APOGEE Innovation Challenge 2016 has been extended till&nbsp;<strong>22nd February 2016.&nbsp;</strong>Check out http://bits-apogee.org/aic for more info.</p>\r\n','2016-02-10'),(4,'First Round of Reverse Engineering ','<p>The first round of&nbsp;<strong>Reverse Engineering&nbsp;</strong>is an Online Proficiency Quiz that would begin on&nbsp;<strong>14th February 2016, 9pm&nbsp;</strong>for 1 day.&nbsp;On-spot registrations for this round is also available.&nbsp;</p>\r\n','2016-02-13'),(5,'Lacuna','<p><strong>Lacuna</strong> is up !!</p>\r\n\r\n<p>Play now&nbsp;<a href=\"http://www.bits-apogee.org/lacuna\" target=\"_blank\">www.bits-apogee.org/lacuna</a></p>','2016-02-14'),(6,'Reverse Engineering is live !','<p>The first round of&nbsp;<strong>Reverse Engineering&nbsp;</strong>is currently going on at&nbsp;www.bits-apogee.org/reveng. Register in teams and play the quiz and get an entry to the final round of it, to be held at APOGEE 2016.&nbsp;</p>\r\n\r\n<p>Anyone can register for the quiz. The link is active till <strong>15th February 2016.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n','2016-02-14'),(7,'I-Strike Problem Statement','<p>The problem statement for the first round of I-Strike is uploaded in the events tab.</p>\r\n','2016-02-14'),(8,'Extension of Deadline for ESPOIR','<p>The last date for the submission of executive summary for event: ESPOIR<strong>&nbsp;</strong>has been extended till&nbsp;<strong>Sunday, 21th February 2016</strong>.</p>\r\n','2016-02-20');
/*!40000 ALTER TABLE `backend_updates` ENABLE KEYS */;
UNLOCK TABLES;

