 in India.',1,26,0),(22,'subrat prasad sahu ','reg.no-11411826, room no-524 , block-b, hostel -bh3, lovely professional university , Jalandhar-Delhi G.T. Road, National Highway 1, Phagwara, Punjab 144411','2','b-tech ','subratsahu1109@gmail.com',9855286401,'my integrative skill help me to be campus ambassador  ',1,29,0),(23,'Utkarsh Mehta','291 , Chanakya Puri , H.M. Sec-4 , Udaipur (raj.)','2','B.TECH','ut.mehta369@gmail.com',7737503738,'I think I am responsible person and Passionate about my work .In every work my motive is for welfare of others by any way.',1,30,0),(24,'MAHESH KUMAR','NEAR SANSKRIT SCHOOL BEWAR CHURU 331301','4','b.tech','csengineermahesh@gmail.com',8094800909,'',1,32,0),(25,'Yatin Gilhotra','#158 Model Town, Ambala city, Haryana','2','ECE','yatingilhotra999@gmail.com',8295295003,'Being an active member of IEEE DTU PR team, I am very well versed with the strategies and techniques to publicise the concerned event in the most effective and attractive manner. Also to use the college resources and human resources at college for the publicising the events efficiently is something I find my domain of work.',1,42,1),(26,'Meenaly Yadav','IET DAVV girls Hostel khandwa road Indore Madhya Pradesh','2','B.E.','sweetmeenu136@gmail.com',9685517616,'As I am an extrovert and outspoken girl because of which I can interact with more number of people so as to inspire the student for tech fest...This quality make me a good contender for campus ambassador',1,47,0),(27,'Abhishek Gupta','7596/5 Bachittar Nagar,Opposite Railway Line,Patiala','2','B.Tech','abhi97806@gmail.com',9780639847,'1. I am well connected on my Campus,and also not a busy person ,so its easier for me to organize activities and reach large number of students.\n2. I am independent.This means working without a direct supervisor, staying motivated, and following through on projects.\n3. I have organized various events in 1st year and have great work experience.\n4. I think i am a little creative.When I attempt to solve a problem, I am  able to come up with lots of different solutions..!\n5. I am outgoing.I feel comfortable speaking with strangers both one-on-one and in front of a group.\n',1,51,0),(28,'ABHISHEK BISHNOI','chak: 55 NP, post: NANUWALA, thasil: RAISINGHNAGAR, DISS. : SRI GANGA NAGAR -335051','1','B.TECH','ab55np@gmail.com',9982709074,'i have a good leadership quality. i am organised and managed one science fair and two other events. i have good skill of leadership. ',1,55,1),(29,'HARISH RITHISH','75,AMBER B,NIT TRICHY,THUVAKUDI,TANJORE MAIN ROAD,TRICHY.620015.','2','B.Tech.','harishrithish7@gmail.com',9597895555,'Being a tech enthusiast, I have followed APOGEE in the past and hence have understood the unique and distinguishing features of the grand fest. Having been the class representative of the computer science department , I’ve developed the skill of persuading  others in a pleasant, yet convincing manner .My proficiency in communication has allowed me to maintain a network of  contacts with a wide range of people from diverse background. I believe these qualities integrated with my enthusiasm would make me a great campus ambassador.',1,57,1),(30,'Shiven Krishan Ahuja','Chandigarh','3','Bachelor of Technology','shivenahuja85@gmail.com',9878817416,'Been a campus ambassador before. Know all its duties.',1,51,0),(31,'Chirag Mantri','43-C,Pocket A/1,Mayur Vihar Phase 3,Delhi-110096','3','B-Tech(Computer Science)','chirag.mantri9@gmail.com',9646374936,'Confidence on the right track and Determination to do any job given with the required amount of Efforts and Hardwork. ',1,73,0),(32,'PRASHANT KUMAR DWIVEDI','S 24/37-3M, TAKTAKPUR,ORDARLY BAZAR, VARANASI,UTTAR PRADESH ','2','B.TECH(ME)','prashantkdvd@gmail.com',7376551993,'TO EXPERIENCE NEW RESPONSIBILITIES AND TO BE ON TIME AND LEARN TO HOLD IT AS A  PROFESSIONALS.',1,74,0),(33,'Piyush Mehndiratta','Room No. 414, Shivalik Boys Hostel , GGS Indraprastha university, Dwarka , Sec 16 C, New Delhi 110078','1